package en.bible;

public class enbible20 {

public enbible20() {

putmapbible20();

}

private void putmapbible20() {

ensuperobject.biblemap.put("b20_1_1", new ensuperobject(20,1,1,"The proverbs of Solomon the son of David, king of Israel;"));
ensuperobject.biblemap.put("b20_1_2", new ensuperobject(20,1,2,"To know wisdom and instruction; to perceive the words of understanding;"));
ensuperobject.biblemap.put("b20_1_3", new ensuperobject(20,1,3,"To receive the instruction of wisdom, justice, and judgment, and equity;"));
ensuperobject.biblemap.put("b20_1_4", new ensuperobject(20,1,4,"To give subtilty to the simple, to the young man knowledge and discretion."));
ensuperobject.biblemap.put("b20_1_5", new ensuperobject(20,1,5,"A wise man will hear, and will increase learning; and a man of understanding shall attain unto wise counsels:"));
ensuperobject.biblemap.put("b20_1_6", new ensuperobject(20,1,6,"To understand a proverb, and the interpretation; the words of the wise, and their dark sayings."));
ensuperobject.biblemap.put("b20_1_7", new ensuperobject(20,1,7,"The fear of the LORD is the beginning of knowledge: but fools despise wisdom and instruction."));
ensuperobject.biblemap.put("b20_1_8", new ensuperobject(20,1,8,"My son, hear the instruction of thy father, and forsake not the law of thy mother:"));
ensuperobject.biblemap.put("b20_1_9", new ensuperobject(20,1,9,"For they shall be an ornament of grace unto thy head, and chains about thy neck."));
ensuperobject.biblemap.put("b20_1_10", new ensuperobject(20,1,10,"My son, if sinners entice thee, consent thou not."));
ensuperobject.biblemap.put("b20_1_11", new ensuperobject(20,1,11,"If they say, Come with us, let us lay wait for blood, let us lurk privily for the innocent without cause:"));
ensuperobject.biblemap.put("b20_1_12", new ensuperobject(20,1,12,"Let us swallow them up alive as the grave; and whole, as those that go down into the pit:"));
ensuperobject.biblemap.put("b20_1_13", new ensuperobject(20,1,13,"We shall find all precious substance, we shall fill our houses with spoil:"));
ensuperobject.biblemap.put("b20_1_14", new ensuperobject(20,1,14,"Cast in thy lot among us; let us all have one purse:"));
ensuperobject.biblemap.put("b20_1_15", new ensuperobject(20,1,15,"My son, walk not thou in the way with them; refrain thy foot from their path:"));
ensuperobject.biblemap.put("b20_1_16", new ensuperobject(20,1,16,"For their feet run to evil, and make haste to shed blood."));
ensuperobject.biblemap.put("b20_1_17", new ensuperobject(20,1,17,"Surely in vain the net is spread in the sight of any bird."));
ensuperobject.biblemap.put("b20_1_18", new ensuperobject(20,1,18,"And they lay wait for their own blood; they lurk privily for their own lives."));
ensuperobject.biblemap.put("b20_1_19", new ensuperobject(20,1,19,"So are the ways of every one that is greedy of gain; which taketh away the life of the owners thereof."));
ensuperobject.biblemap.put("b20_1_20", new ensuperobject(20,1,20,"Wisdom crieth without; she uttereth her voice in the streets:"));
ensuperobject.biblemap.put("b20_1_21", new ensuperobject(20,1,21,"She crieth in the chief place of concourse, in the openings of the gates: in the city she uttereth her words, saying,"));
ensuperobject.biblemap.put("b20_1_22", new ensuperobject(20,1,22,"How long, ye simple ones, will ye love simplicity? and the scorners delight in their scorning, and fools hate knowledge?"));
ensuperobject.biblemap.put("b20_1_23", new ensuperobject(20,1,23,"Turn you at my reproof: behold, I will pour out my spirit unto you, I will make known my words unto you."));
ensuperobject.biblemap.put("b20_1_24", new ensuperobject(20,1,24,"Because I have called, and ye refused; I have stretched out my hand, and no man regarded;"));
ensuperobject.biblemap.put("b20_1_25", new ensuperobject(20,1,25,"But ye have set at nought all my counsel, and would none of my reproof:"));
ensuperobject.biblemap.put("b20_1_26", new ensuperobject(20,1,26,"I also will laugh at your calamity; I will mock when your fear cometh;"));
ensuperobject.biblemap.put("b20_1_27", new ensuperobject(20,1,27,"When your fear cometh as desolation, and your destruction cometh as a whirlwind; when distress and anguish cometh upon you."));
ensuperobject.biblemap.put("b20_1_28", new ensuperobject(20,1,28,"Then shall they call upon me, but I will not answer; they shall seek me early, but they shall not find me:"));
ensuperobject.biblemap.put("b20_1_29", new ensuperobject(20,1,29,"For that they hated knowledge, and did not choose the fear of the LORD:"));
ensuperobject.biblemap.put("b20_1_30", new ensuperobject(20,1,30,"They would none of my counsel: they despised all my reproof."));
ensuperobject.biblemap.put("b20_1_31", new ensuperobject(20,1,31,"Therefore shall they eat of the fruit of their own way, and be filled with their own devices."));
ensuperobject.biblemap.put("b20_1_32", new ensuperobject(20,1,32,"For the turning away of the simple shall slay them, and the prosperity of fools shall destroy them."));
ensuperobject.biblemap.put("b20_1_33", new ensuperobject(20,1,33,"But whoso hearkeneth unto me shall dwell safely, and shall be quiet from fear of evil."));
ensuperobject.biblemap.put("b20_2_1", new ensuperobject(20,2,1,"My son, if thou wilt receive my words, and hide my commandments with thee;"));
ensuperobject.biblemap.put("b20_2_2", new ensuperobject(20,2,2,"So that thou incline thine ear unto wisdom, and apply thine heart to understanding;"));
ensuperobject.biblemap.put("b20_2_3", new ensuperobject(20,2,3,"Yea, if thou criest after knowledge, and liftest up thy voice for understanding;"));
ensuperobject.biblemap.put("b20_2_4", new ensuperobject(20,2,4,"If thou seekest her as silver, and searchest for her as for hid treasures;"));
ensuperobject.biblemap.put("b20_2_5", new ensuperobject(20,2,5,"Then shalt thou understand the fear of the LORD, and find the knowledge of God."));
ensuperobject.biblemap.put("b20_2_6", new ensuperobject(20,2,6,"For the LORD giveth wisdom: out of his mouth cometh knowledge and understanding."));
ensuperobject.biblemap.put("b20_2_7", new ensuperobject(20,2,7,"He layeth up sound wisdom for the righteous: he is a buckler to them that walk uprightly."));
ensuperobject.biblemap.put("b20_2_8", new ensuperobject(20,2,8,"He keepeth the paths of judgment, and preserveth the way of his saints."));
ensuperobject.biblemap.put("b20_2_9", new ensuperobject(20,2,9,"Then shalt thou understand righteousness, and judgment, and equity; yea, every good path."));
ensuperobject.biblemap.put("b20_2_10", new ensuperobject(20,2,10,"When wisdom entereth into thine heart, and knowledge is pleasant unto thy soul;"));
ensuperobject.biblemap.put("b20_2_11", new ensuperobject(20,2,11,"Discretion shall preserve thee, understanding shall keep thee:"));
ensuperobject.biblemap.put("b20_2_12", new ensuperobject(20,2,12,"To deliver thee from the way of the evil man, from the man that speaketh froward things;"));
ensuperobject.biblemap.put("b20_2_13", new ensuperobject(20,2,13,"Who leave the paths of uprightness, to walk in the ways of darkness;"));
ensuperobject.biblemap.put("b20_2_14", new ensuperobject(20,2,14,"Who rejoice to do evil, and delight in the frowardness of the wicked;"));
ensuperobject.biblemap.put("b20_2_15", new ensuperobject(20,2,15,"Whose ways are crooked, and they froward in their paths:"));
ensuperobject.biblemap.put("b20_2_16", new ensuperobject(20,2,16,"To deliver thee from the strange woman, even from the stranger which flattereth with her words;"));
ensuperobject.biblemap.put("b20_2_17", new ensuperobject(20,2,17,"Which forsaketh the guide of her youth, and forgetteth the covenant of her God."));
ensuperobject.biblemap.put("b20_2_18", new ensuperobject(20,2,18,"For her house inclineth unto death, and her paths unto the dead."));
ensuperobject.biblemap.put("b20_2_19", new ensuperobject(20,2,19,"None that go unto her return again, neither take they hold of the paths of life."));
ensuperobject.biblemap.put("b20_2_20", new ensuperobject(20,2,20,"That thou mayest walk in the way of good men, and keep the paths of the righteous."));
ensuperobject.biblemap.put("b20_2_21", new ensuperobject(20,2,21,"For the upright shall dwell in the land, and the perfect shall remain in it."));
ensuperobject.biblemap.put("b20_2_22", new ensuperobject(20,2,22,"But the wicked shall be cut off from the earth, and the transgressors shall be rooted out of it."));
ensuperobject.biblemap.put("b20_3_1", new ensuperobject(20,3,1,"My son, forget not my law; but let thine heart keep my commandments:"));
ensuperobject.biblemap.put("b20_3_2", new ensuperobject(20,3,2,"For length of days, and long life, and peace, shall they add to thee."));
ensuperobject.biblemap.put("b20_3_3", new ensuperobject(20,3,3,"Let not mercy and truth forsake thee: bind them about thy neck; write them upon the table of thine heart:"));
ensuperobject.biblemap.put("b20_3_4", new ensuperobject(20,3,4,"So shalt thou find favour and good understanding in the sight of God and man."));
ensuperobject.biblemap.put("b20_3_5", new ensuperobject(20,3,5,"Trust in the LORD with all thine heart; and lean not unto thine own understanding."));
ensuperobject.biblemap.put("b20_3_6", new ensuperobject(20,3,6,"In all thy ways acknowledge him, and he shall direct thy paths."));
ensuperobject.biblemap.put("b20_3_7", new ensuperobject(20,3,7,"Be not wise in thine own eyes: fear the LORD, and depart from evil."));
ensuperobject.biblemap.put("b20_3_8", new ensuperobject(20,3,8,"It shall be health to thy navel, and marrow to thy bones."));
ensuperobject.biblemap.put("b20_3_9", new ensuperobject(20,3,9,"Honour the LORD with thy substance, and with the firstfruits of all thine increase:"));
ensuperobject.biblemap.put("b20_3_10", new ensuperobject(20,3,10,"So shall thy barns be filled with plenty, and thy presses shall burst out with new wine."));
ensuperobject.biblemap.put("b20_3_11", new ensuperobject(20,3,11,"My son, despise not the chastening of the LORD; neither be weary of his correction:"));
ensuperobject.biblemap.put("b20_3_12", new ensuperobject(20,3,12,"For whom the LORD loveth he correcteth; even as a father the son in whom he delighteth."));
ensuperobject.biblemap.put("b20_3_13", new ensuperobject(20,3,13,"Happy is the man that findeth wisdom, and the man that getteth understanding."));
ensuperobject.biblemap.put("b20_3_14", new ensuperobject(20,3,14,"For the merchandise of it is better than the merchandise of silver, and the gain thereof than fine gold."));
ensuperobject.biblemap.put("b20_3_15", new ensuperobject(20,3,15,"She is more precious than rubies: and all the things thou canst desire are not to be compared unto her."));
ensuperobject.biblemap.put("b20_3_16", new ensuperobject(20,3,16,"Length of days is in her right hand; and in her left hand riches and honour."));
ensuperobject.biblemap.put("b20_3_17", new ensuperobject(20,3,17,"Her ways are ways of pleasantness, and all her paths are peace."));
ensuperobject.biblemap.put("b20_3_18", new ensuperobject(20,3,18,"She is a tree of life to them that lay hold upon her: and happy is every one that retaineth her."));
ensuperobject.biblemap.put("b20_3_19", new ensuperobject(20,3,19,"The LORD by wisdom hath founded the earth; by understanding hath he established the heavens."));
ensuperobject.biblemap.put("b20_3_20", new ensuperobject(20,3,20,"By his knowledge the depths are broken up, and the clouds drop down the dew."));
ensuperobject.biblemap.put("b20_3_21", new ensuperobject(20,3,21,"My son, let not them depart from thine eyes: keep sound wisdom and discretion:"));
ensuperobject.biblemap.put("b20_3_22", new ensuperobject(20,3,22,"So shall they be life unto thy soul, and grace to thy neck."));
ensuperobject.biblemap.put("b20_3_23", new ensuperobject(20,3,23,"Then shalt thou walk in thy way safely, and thy foot shall not stumble."));
ensuperobject.biblemap.put("b20_3_24", new ensuperobject(20,3,24,"When thou liest down, thou shalt not be afraid: yea, thou shalt lie down, and thy sleep shall be sweet."));
ensuperobject.biblemap.put("b20_3_25", new ensuperobject(20,3,25,"Be not afraid of sudden fear, neither of the desolation of the wicked, when it cometh."));
ensuperobject.biblemap.put("b20_3_26", new ensuperobject(20,3,26,"For the LORD shall be thy confidence, and shall keep thy foot from being taken."));
ensuperobject.biblemap.put("b20_3_27", new ensuperobject(20,3,27,"Withhold not good from them to whom it is due, when it is in the power of thine hand to do it."));
ensuperobject.biblemap.put("b20_3_28", new ensuperobject(20,3,28,"Say not unto thy neighbour, Go, and come again, and to morrow I will give; when thou hast it by thee."));
ensuperobject.biblemap.put("b20_3_29", new ensuperobject(20,3,29,"Devise not evil against thy neighbour, seeing he dwelleth securely by thee."));
ensuperobject.biblemap.put("b20_3_30", new ensuperobject(20,3,30,"Strive not with a man without cause, if he have done thee no harm."));
ensuperobject.biblemap.put("b20_3_31", new ensuperobject(20,3,31,"Envy thou not the oppressor, and choose none of his ways."));
ensuperobject.biblemap.put("b20_3_32", new ensuperobject(20,3,32,"For the froward is abomination to the LORD: but his secret is with the righteous."));
ensuperobject.biblemap.put("b20_3_33", new ensuperobject(20,3,33,"The curse of the LORD is in the house of the wicked: but he blesseth the habitation of the just."));
ensuperobject.biblemap.put("b20_3_34", new ensuperobject(20,3,34,"Surely he scorneth the scorners: but he giveth grace unto the lowly."));
ensuperobject.biblemap.put("b20_3_35", new ensuperobject(20,3,35,"The wise shall inherit glory: but shame shall be the promotion of fools."));
ensuperobject.biblemap.put("b20_4_1", new ensuperobject(20,4,1,"Hear, ye children, the instruction of a father, and attend to know understanding."));
ensuperobject.biblemap.put("b20_4_2", new ensuperobject(20,4,2,"For I give you good doctrine, forsake ye not my law."));
ensuperobject.biblemap.put("b20_4_3", new ensuperobject(20,4,3,"For I was my father's son, tender and only beloved in the sight of my mother."));
ensuperobject.biblemap.put("b20_4_4", new ensuperobject(20,4,4,"He taught me also, and said unto me, Let thine heart retain my words: keep my commandments, and live."));
ensuperobject.biblemap.put("b20_4_5", new ensuperobject(20,4,5,"Get wisdom, get understanding: forget it not; neither decline from the words of my mouth."));
ensuperobject.biblemap.put("b20_4_6", new ensuperobject(20,4,6,"Forsake her not, and she shall preserve thee: love her, and she shall keep thee."));
ensuperobject.biblemap.put("b20_4_7", new ensuperobject(20,4,7,"Wisdom is the principal thing; therefore get wisdom: and with all thy getting get understanding."));
ensuperobject.biblemap.put("b20_4_8", new ensuperobject(20,4,8,"Exalt her, and she shall promote thee: she shall bring thee to honour, when thou dost embrace her."));
ensuperobject.biblemap.put("b20_4_9", new ensuperobject(20,4,9,"She shall give to thine head an ornament of grace: a crown of glory shall she deliver to thee."));
ensuperobject.biblemap.put("b20_4_10", new ensuperobject(20,4,10,"Hear, O my son, and receive my sayings; and the years of thy life shall be many."));
ensuperobject.biblemap.put("b20_4_11", new ensuperobject(20,4,11,"I have taught thee in the way of wisdom; I have led thee in right paths."));
ensuperobject.biblemap.put("b20_4_12", new ensuperobject(20,4,12,"When thou goest, thy steps shall not be straitened; and when thou runnest, thou shalt not stumble."));
ensuperobject.biblemap.put("b20_4_13", new ensuperobject(20,4,13,"Take fast hold of instruction; let her not go: keep her; for she is thy life."));
ensuperobject.biblemap.put("b20_4_14", new ensuperobject(20,4,14,"Enter not into the path of the wicked, and go not in the way of evil men."));
ensuperobject.biblemap.put("b20_4_15", new ensuperobject(20,4,15,"Avoid it, pass not by it, turn from it, and pass away."));
ensuperobject.biblemap.put("b20_4_16", new ensuperobject(20,4,16,"For they sleep not, except they have done mischief; and their sleep is taken away, unless they cause some to fall."));
ensuperobject.biblemap.put("b20_4_17", new ensuperobject(20,4,17,"For they eat the bread of wickedness, and drink the wine of violence."));
ensuperobject.biblemap.put("b20_4_18", new ensuperobject(20,4,18,"But the path of the just is as the shining light, that shineth more and more unto the perfect day."));
ensuperobject.biblemap.put("b20_4_19", new ensuperobject(20,4,19,"The way of the wicked is as darkness: they know not at what they stumble."));
ensuperobject.biblemap.put("b20_4_20", new ensuperobject(20,4,20,"My son, attend to my words; incline thine ear unto my sayings."));
ensuperobject.biblemap.put("b20_4_21", new ensuperobject(20,4,21,"Let them not depart from thine eyes; keep them in the midst of thine heart."));
ensuperobject.biblemap.put("b20_4_22", new ensuperobject(20,4,22,"For they are life unto those that find them, and health to all their flesh."));
ensuperobject.biblemap.put("b20_4_23", new ensuperobject(20,4,23,"Keep thy heart with all diligence; for out of it are the issues of life."));
ensuperobject.biblemap.put("b20_4_24", new ensuperobject(20,4,24,"Put away from thee a froward mouth, and perverse lips put far from thee."));
ensuperobject.biblemap.put("b20_4_25", new ensuperobject(20,4,25,"Let thine eyes look right on, and let thine eyelids look straight before thee."));
ensuperobject.biblemap.put("b20_4_26", new ensuperobject(20,4,26,"Ponder the path of thy feet, and let all thy ways be established."));
ensuperobject.biblemap.put("b20_4_27", new ensuperobject(20,4,27,"Turn not to the right hand nor to the left: remove thy foot from evil."));
ensuperobject.biblemap.put("b20_5_1", new ensuperobject(20,5,1,"My son, attend unto my wisdom, and bow thine ear to my understanding:"));
ensuperobject.biblemap.put("b20_5_2", new ensuperobject(20,5,2,"That thou mayest regard discretion, and that thy lips may keep knowledge."));
ensuperobject.biblemap.put("b20_5_3", new ensuperobject(20,5,3,"For the lips of a strange woman drop as an honeycomb, and her mouth is smoother than oil:"));
ensuperobject.biblemap.put("b20_5_4", new ensuperobject(20,5,4,"But her end is bitter as wormwood, sharp as a two-edged sword."));
ensuperobject.biblemap.put("b20_5_5", new ensuperobject(20,5,5,"Her feet go down to death; her steps take hold on hell."));
ensuperobject.biblemap.put("b20_5_6", new ensuperobject(20,5,6,"Lest thou shouldest ponder the path of life, her ways are moveable, that thou canst not know them."));
ensuperobject.biblemap.put("b20_5_7", new ensuperobject(20,5,7,"Hear me now therefore, O ye children, and depart not from the words of my mouth."));
ensuperobject.biblemap.put("b20_5_8", new ensuperobject(20,5,8,"Remove thy way far from her, and come not nigh the door of her house:"));
ensuperobject.biblemap.put("b20_5_9", new ensuperobject(20,5,9,"Lest thou give thine honour unto others, and thy years unto the cruel:"));
ensuperobject.biblemap.put("b20_5_10", new ensuperobject(20,5,10,"Lest strangers be filled with thy wealth; and thy labours be in the house of a stranger;"));
ensuperobject.biblemap.put("b20_5_11", new ensuperobject(20,5,11,"And thou mourn at the last, when thy flesh and thy body are consumed,"));
ensuperobject.biblemap.put("b20_5_12", new ensuperobject(20,5,12,"And say, How have I hated instruction, and my heart despised reproof;"));
ensuperobject.biblemap.put("b20_5_13", new ensuperobject(20,5,13,"And have not obeyed the voice of my teachers, nor inclined mine ear to them that instructed me!"));
ensuperobject.biblemap.put("b20_5_14", new ensuperobject(20,5,14,"I was almost in all evil in the midst of the congregation and assembly."));
ensuperobject.biblemap.put("b20_5_15", new ensuperobject(20,5,15,"Drink waters out of thine own cistern, and running waters out of thine own well."));
ensuperobject.biblemap.put("b20_5_16", new ensuperobject(20,5,16,"Let thy fountains be dispersed abroad, and rivers of waters in the streets."));
ensuperobject.biblemap.put("b20_5_17", new ensuperobject(20,5,17,"Let them be only thine own, and not strangers' with thee."));
ensuperobject.biblemap.put("b20_5_18", new ensuperobject(20,5,18,"Let thy fountain be blessed: and rejoice with the wife of thy youth."));
ensuperobject.biblemap.put("b20_5_19", new ensuperobject(20,5,19,"Let her be as the loving hind and pleasant roe; let her breasts satisfy thee at all times; and be thou ravished always with her love."));
ensuperobject.biblemap.put("b20_5_20", new ensuperobject(20,5,20,"And why wilt thou, my son, be ravished with a strange woman, and embrace the bosom of a stranger?"));
ensuperobject.biblemap.put("b20_5_21", new ensuperobject(20,5,21,"For the ways of man are before the eyes of the LORD, and he pondereth all his goings."));
ensuperobject.biblemap.put("b20_5_22", new ensuperobject(20,5,22,"His own iniquities shall take the wicked himself, and he shall be holden with the cords of his sins."));
ensuperobject.biblemap.put("b20_5_23", new ensuperobject(20,5,23,"He shall die without instruction; and in the greatness of his folly he shall go astray."));
ensuperobject.biblemap.put("b20_6_1", new ensuperobject(20,6,1,"My son, if thou be surety for thy friend, if thou hast stricken thy hand with a stranger,"));
ensuperobject.biblemap.put("b20_6_2", new ensuperobject(20,6,2,"Thou art snared with the words of thy mouth, thou art taken with the words of thy mouth."));
ensuperobject.biblemap.put("b20_6_3", new ensuperobject(20,6,3,"Do this now, my son, and deliver thyself, when thou art come into the hand of thy friend; go, humble thyself, and make sure thy friend."));
ensuperobject.biblemap.put("b20_6_4", new ensuperobject(20,6,4,"Give not sleep to thine eyes, nor slumber to thine eyelids."));
ensuperobject.biblemap.put("b20_6_5", new ensuperobject(20,6,5,"Deliver thyself as a roe from the hand of the hunter, and as a bird from the hand of the fowler."));
ensuperobject.biblemap.put("b20_6_6", new ensuperobject(20,6,6,"Go to the ant, thou sluggard; consider her ways, and be wise:"));
ensuperobject.biblemap.put("b20_6_7", new ensuperobject(20,6,7,"Which having no guide, overseer, or ruler,"));
ensuperobject.biblemap.put("b20_6_8", new ensuperobject(20,6,8,"Provideth her meat in the summer, and gathereth her food in the harvest."));
ensuperobject.biblemap.put("b20_6_9", new ensuperobject(20,6,9,"How long wilt thou sleep, O sluggard? when wilt thou arise out of thy sleep?"));
ensuperobject.biblemap.put("b20_6_10", new ensuperobject(20,6,10,"Yet a little sleep, a little slumber, a little folding of the hands to sleep:"));
ensuperobject.biblemap.put("b20_6_11", new ensuperobject(20,6,11,"So shall thy poverty come as one that travelleth, and thy want as an armed man."));
ensuperobject.biblemap.put("b20_6_12", new ensuperobject(20,6,12,"A naughty person, a wicked man, walketh with a froward mouth."));
ensuperobject.biblemap.put("b20_6_13", new ensuperobject(20,6,13,"He winketh with his eyes, he speaketh with his feet, he teacheth with his fingers;"));
ensuperobject.biblemap.put("b20_6_14", new ensuperobject(20,6,14,"Frowardness is in his heart, he deviseth mischief continually; he soweth discord."));
ensuperobject.biblemap.put("b20_6_15", new ensuperobject(20,6,15,"Therefore shall his calamity come suddenly; suddenly shall he be broken without remedy."));
ensuperobject.biblemap.put("b20_6_16", new ensuperobject(20,6,16,"These six things doth the LORD hate: yea, seven are an abomination unto him:"));
ensuperobject.biblemap.put("b20_6_17", new ensuperobject(20,6,17,"A proud look, a lying tongue, and hands that shed innocent blood,"));
ensuperobject.biblemap.put("b20_6_18", new ensuperobject(20,6,18,"An heart that deviseth wicked imaginations, feet that be swift in running to mischief,"));
ensuperobject.biblemap.put("b20_6_19", new ensuperobject(20,6,19,"A false witness that speaketh lies, and he that soweth discord among brethren."));
ensuperobject.biblemap.put("b20_6_20", new ensuperobject(20,6,20,"My son, keep thy father's commandment, and forsake not the law of thy mother:"));
ensuperobject.biblemap.put("b20_6_21", new ensuperobject(20,6,21,"Bind them continually upon thine heart, and tie them about thy neck."));
ensuperobject.biblemap.put("b20_6_22", new ensuperobject(20,6,22,"When thou goest, it shall lead thee; when thou sleepest, it shall keep thee; and when thou awakest, it shall talk with thee."));
ensuperobject.biblemap.put("b20_6_23", new ensuperobject(20,6,23,"For the commandment is a lamp; and the law is light; and reproofs of instruction are the way of life:"));
ensuperobject.biblemap.put("b20_6_24", new ensuperobject(20,6,24,"To keep thee from the evil woman, from the flattery of the tongue of a strange woman."));
ensuperobject.biblemap.put("b20_6_25", new ensuperobject(20,6,25,"Lust not after her beauty in thine heart; neither let her take thee with her eyelids."));
ensuperobject.biblemap.put("b20_6_26", new ensuperobject(20,6,26,"For by means of a whorish woman a man is brought to a piece of bread: and the adulteress will hunt for the precious life."));
ensuperobject.biblemap.put("b20_6_27", new ensuperobject(20,6,27,"Can a man take fire in his bosom, and his clothes not be burned?"));
ensuperobject.biblemap.put("b20_6_28", new ensuperobject(20,6,28,"Can one go upon hot coals, and his feet not be burned?"));
ensuperobject.biblemap.put("b20_6_29", new ensuperobject(20,6,29,"So he that goeth in to his neighbour's wife; whosoever toucheth her shall not be innocent."));
ensuperobject.biblemap.put("b20_6_30", new ensuperobject(20,6,30,"Men do not despise a thief, if he steal to satisfy his soul when he is hungry;"));
ensuperobject.biblemap.put("b20_6_31", new ensuperobject(20,6,31,"But if he be found, he shall restore sevenfold; he shall give all the substance of his house."));
ensuperobject.biblemap.put("b20_6_32", new ensuperobject(20,6,32,"But whoso committeth adultery with a woman lacketh understanding: he that doeth it destroyeth his own soul."));
ensuperobject.biblemap.put("b20_6_33", new ensuperobject(20,6,33,"A wound and dishonour shall he get; and his reproach shall not be wiped away."));
ensuperobject.biblemap.put("b20_6_34", new ensuperobject(20,6,34,"For jealousy is the rage of a man: therefore he will not spare in the day of vengeance."));
ensuperobject.biblemap.put("b20_6_35", new ensuperobject(20,6,35,"He will not regard any ransom; neither will he rest content, though thou givest many gifts."));
ensuperobject.biblemap.put("b20_7_1", new ensuperobject(20,7,1,"My son, keep my words, and lay up my commandments with thee."));
ensuperobject.biblemap.put("b20_7_2", new ensuperobject(20,7,2,"Keep my commandments, and live; and my law as the apple of thine eye."));
ensuperobject.biblemap.put("b20_7_3", new ensuperobject(20,7,3,"Bind them upon thy fingers, write them upon the table of thine heart."));
ensuperobject.biblemap.put("b20_7_4", new ensuperobject(20,7,4,"Say unto wisdom, Thou art my sister; and call understanding thy kinswoman:"));
ensuperobject.biblemap.put("b20_7_5", new ensuperobject(20,7,5,"That they may keep thee from the strange woman, from the stranger which flattereth with her words."));
ensuperobject.biblemap.put("b20_7_6", new ensuperobject(20,7,6,"For at the window of my house I looked through my casement,"));
ensuperobject.biblemap.put("b20_7_7", new ensuperobject(20,7,7,"And beheld among the simple ones, I discerned among the youths, a young man void of understanding,"));
ensuperobject.biblemap.put("b20_7_8", new ensuperobject(20,7,8,"Passing through the street near her corner; and he went the way to her house,"));
ensuperobject.biblemap.put("b20_7_9", new ensuperobject(20,7,9,"In the twilight, in the evening, in the black and dark night:"));
ensuperobject.biblemap.put("b20_7_10", new ensuperobject(20,7,10,"And, behold, there met him a woman with the attire of an harlot, and subtil of heart."));
ensuperobject.biblemap.put("b20_7_11", new ensuperobject(20,7,11,"(She is loud and stubborn; her feet abide not in her house:"));
ensuperobject.biblemap.put("b20_7_12", new ensuperobject(20,7,12,"Now is she without, now in the streets, and lieth in wait at every corner.)"));
ensuperobject.biblemap.put("b20_7_13", new ensuperobject(20,7,13,"So she caught him, and kissed him, and with an impudent face said unto him,"));
ensuperobject.biblemap.put("b20_7_14", new ensuperobject(20,7,14,"I have peace offerings with me; this day have I payed my vows."));
ensuperobject.biblemap.put("b20_7_15", new ensuperobject(20,7,15,"Therefore came I forth to meet thee, diligently to seek thy face, and I have found thee."));
ensuperobject.biblemap.put("b20_7_16", new ensuperobject(20,7,16,"I have decked my bed with coverings of tapestry, with carved works, with fine linen of Egypt."));
ensuperobject.biblemap.put("b20_7_17", new ensuperobject(20,7,17,"I have perfumed my bed with myrrh, aloes, and cinnamon."));
ensuperobject.biblemap.put("b20_7_18", new ensuperobject(20,7,18,"Come, let us take our fill of love until the morning: let us solace ourselves with loves."));
ensuperobject.biblemap.put("b20_7_19", new ensuperobject(20,7,19,"For the goodman is not at home, he is gone a long journey:"));
ensuperobject.biblemap.put("b20_7_20", new ensuperobject(20,7,20,"He hath taken a bag of money with him, and will come home at the day appointed."));
ensuperobject.biblemap.put("b20_7_21", new ensuperobject(20,7,21,"With her much fair speech she caused him to yield, with the flattering of her lips she forced him."));
ensuperobject.biblemap.put("b20_7_22", new ensuperobject(20,7,22,"He goeth after her straightway, as an ox goeth to the slaughter, or as a fool to the correction of the stocks;"));
ensuperobject.biblemap.put("b20_7_23", new ensuperobject(20,7,23,"Till a dart strike through his liver; as a bird hasteth to the snare, and knoweth not that it is for his life."));
ensuperobject.biblemap.put("b20_7_24", new ensuperobject(20,7,24,"Hearken unto me now therefore, O ye children, and attend to the words of my mouth."));
ensuperobject.biblemap.put("b20_7_25", new ensuperobject(20,7,25,"Let not thine heart decline to her ways, go not astray in her paths."));
ensuperobject.biblemap.put("b20_7_26", new ensuperobject(20,7,26,"For she hath cast down many wounded: yea, many strong men have been slain by her."));
ensuperobject.biblemap.put("b20_7_27", new ensuperobject(20,7,27,"Her house is the way to hell, going down to the chambers of death."));
ensuperobject.biblemap.put("b20_8_1", new ensuperobject(20,8,1,"Doth not wisdom cry? and understanding put forth her voice?"));
ensuperobject.biblemap.put("b20_8_2", new ensuperobject(20,8,2,"She standeth in the top of high places, by the way in the places of the paths."));
ensuperobject.biblemap.put("b20_8_3", new ensuperobject(20,8,3,"She crieth at the gates, at the entry of the city, at the coming in at the doors."));
ensuperobject.biblemap.put("b20_8_4", new ensuperobject(20,8,4,"Unto you, O men, I call; and my voice is to the sons of man."));
ensuperobject.biblemap.put("b20_8_5", new ensuperobject(20,8,5,"O ye simple, understand wisdom: and, ye fools, be ye of an understanding heart."));
ensuperobject.biblemap.put("b20_8_6", new ensuperobject(20,8,6,"Hear; for I will speak of excellent things; and the opening of my lips shall be right things."));
ensuperobject.biblemap.put("b20_8_7", new ensuperobject(20,8,7,"For my mouth shall speak truth; and wickedness is an abomination to my lips."));
ensuperobject.biblemap.put("b20_8_8", new ensuperobject(20,8,8,"All the words of my mouth are in righteousness; there is nothing froward or perverse in them."));
ensuperobject.biblemap.put("b20_8_9", new ensuperobject(20,8,9,"They are all plain to him that understandeth, and right to them that find knowledge."));
ensuperobject.biblemap.put("b20_8_10", new ensuperobject(20,8,10,"Receive my instruction, and not silver; and knowledge rather than choice gold."));
ensuperobject.biblemap.put("b20_8_11", new ensuperobject(20,8,11,"For wisdom is better than rubies; and all the things that may be desired are not to be compared to it."));
ensuperobject.biblemap.put("b20_8_12", new ensuperobject(20,8,12,"I wisdom dwell with prudence, and find out knowledge of witty inventions."));
ensuperobject.biblemap.put("b20_8_13", new ensuperobject(20,8,13,"The fear of the LORD is to hate evil: pride, and arrogancy, and the evil way, and the froward mouth, do I hate."));
ensuperobject.biblemap.put("b20_8_14", new ensuperobject(20,8,14,"Counsel is mine, and sound wisdom: I am understanding; I have strength."));
ensuperobject.biblemap.put("b20_8_15", new ensuperobject(20,8,15,"By me kings reign, and princes decree justice."));
ensuperobject.biblemap.put("b20_8_16", new ensuperobject(20,8,16,"By me princes rule, and nobles, even all the judges of the earth."));
ensuperobject.biblemap.put("b20_8_17", new ensuperobject(20,8,17,"I love them that love me; and those that seek me early shall find me."));
ensuperobject.biblemap.put("b20_8_18", new ensuperobject(20,8,18,"Riches and honour are with me; yea, durable riches and righteousness."));
ensuperobject.biblemap.put("b20_8_19", new ensuperobject(20,8,19,"My fruit is better than gold, yea, than fine gold; and my revenue than choice silver."));
ensuperobject.biblemap.put("b20_8_20", new ensuperobject(20,8,20,"I lead in the way of righteousness, in the midst of the paths of judgment:"));
ensuperobject.biblemap.put("b20_8_21", new ensuperobject(20,8,21,"That I may cause those that love me to inherit substance; and I will fill their treasures."));
ensuperobject.biblemap.put("b20_8_22", new ensuperobject(20,8,22,"The LORD possessed me in the beginning of his way, before his works of old."));
ensuperobject.biblemap.put("b20_8_23", new ensuperobject(20,8,23,"I was set up from everlasting, from the beginning, or ever the earth was."));
ensuperobject.biblemap.put("b20_8_24", new ensuperobject(20,8,24,"When there were no depths, I was brought forth; when there were no fountains abounding with water."));
ensuperobject.biblemap.put("b20_8_25", new ensuperobject(20,8,25,"Before the mountains were settled, before the hills was I brought forth:"));
ensuperobject.biblemap.put("b20_8_26", new ensuperobject(20,8,26,"While as yet he had not made the earth, nor the fields, nor the highest part of the dust of the world."));
ensuperobject.biblemap.put("b20_8_27", new ensuperobject(20,8,27,"When he prepared the heavens, I was there: when he set a compass upon the face of the depth:"));
ensuperobject.biblemap.put("b20_8_28", new ensuperobject(20,8,28,"When he established the clouds above: when he strengthened the fountains of the deep:"));
ensuperobject.biblemap.put("b20_8_29", new ensuperobject(20,8,29,"When he gave to the sea his decree, that the waters should not pass his commandment: when he appointed the foundations of the earth:"));
ensuperobject.biblemap.put("b20_8_30", new ensuperobject(20,8,30,"Then I was by him, as one brought up with him: and I was daily his delight, rejoicing always before him;"));
ensuperobject.biblemap.put("b20_8_31", new ensuperobject(20,8,31,"Rejoicing in the habitable part of his earth; and my delights were with the sons of men."));
ensuperobject.biblemap.put("b20_8_32", new ensuperobject(20,8,32,"Now therefore hearken unto me, O ye children: for blessed are they that keep my ways."));
ensuperobject.biblemap.put("b20_8_33", new ensuperobject(20,8,33,"Hear instruction, and be wise, and refuse it not."));
ensuperobject.biblemap.put("b20_8_34", new ensuperobject(20,8,34,"Blessed is the man that heareth me, watching daily at my gates, waiting at the posts of my doors."));
ensuperobject.biblemap.put("b20_8_35", new ensuperobject(20,8,35,"For whoso findeth me findeth life, and shall obtain favour of the LORD."));
ensuperobject.biblemap.put("b20_8_36", new ensuperobject(20,8,36,"But he that sinneth against me wrongeth his own soul: all they that hate me love death."));
ensuperobject.biblemap.put("b20_9_1", new ensuperobject(20,9,1,"Wisdom hath builded her house, she hath hewn out her seven pillars:"));
ensuperobject.biblemap.put("b20_9_2", new ensuperobject(20,9,2,"She hath killed her beasts; she hath mingled her wine; she hath also furnished her table."));
ensuperobject.biblemap.put("b20_9_3", new ensuperobject(20,9,3,"She hath sent forth her maidens: she crieth upon the highest places of the city,"));
ensuperobject.biblemap.put("b20_9_4", new ensuperobject(20,9,4,"Whoso is simple, let him turn in hither: as for him that wanteth understanding, she saith to him,"));
ensuperobject.biblemap.put("b20_9_5", new ensuperobject(20,9,5,"Come, eat of my bread, and drink of the wine which I have mingled."));
ensuperobject.biblemap.put("b20_9_6", new ensuperobject(20,9,6,"Forsake the foolish, and live; and go in the way of understanding."));
ensuperobject.biblemap.put("b20_9_7", new ensuperobject(20,9,7,"He that reproveth a scorner getteth to himself shame: and he that rebuketh a wicked man getteth himself a blot."));
ensuperobject.biblemap.put("b20_9_8", new ensuperobject(20,9,8,"Reprove not a scorner, lest he hate thee: rebuke a wise man, and he will love thee."));
ensuperobject.biblemap.put("b20_9_9", new ensuperobject(20,9,9,"Give instruction to a wise man, and he will be yet wiser: teach a just man, and he will increase in learning."));
ensuperobject.biblemap.put("b20_9_10", new ensuperobject(20,9,10,"The fear of the LORD is the beginning of wisdom: and the knowledge of the holy is understanding."));
ensuperobject.biblemap.put("b20_9_11", new ensuperobject(20,9,11,"For by me thy days shall be multiplied, and the years of thy life shall be increased."));
ensuperobject.biblemap.put("b20_9_12", new ensuperobject(20,9,12,"If thou be wise, thou shalt be wise for thyself: but if thou scornest, thou alone shalt bear it."));
ensuperobject.biblemap.put("b20_9_13", new ensuperobject(20,9,13,"A foolish woman is clamorous: she is simple, and knoweth nothing."));
ensuperobject.biblemap.put("b20_9_14", new ensuperobject(20,9,14,"For she sitteth at the door of her house, on a seat in the high places of the city,"));
ensuperobject.biblemap.put("b20_9_15", new ensuperobject(20,9,15,"To call passengers who go right on their ways:"));
ensuperobject.biblemap.put("b20_9_16", new ensuperobject(20,9,16,"Whoso is simple, let him turn in hither: and as for him that wanteth understanding, she saith to him,"));
ensuperobject.biblemap.put("b20_9_17", new ensuperobject(20,9,17,"Stolen waters are sweet, and bread eaten in secret is pleasant."));
ensuperobject.biblemap.put("b20_9_18", new ensuperobject(20,9,18,"But he knoweth not that the dead are there; and that her guests are in the depths of hell."));
ensuperobject.biblemap.put("b20_10_1", new ensuperobject(20,10,1,"The proverbs of Solomon. A wise son maketh a glad father: but a foolish son is the heaviness of his mother."));
ensuperobject.biblemap.put("b20_10_2", new ensuperobject(20,10,2,"Treasures of wickedness profit nothing: but righteousness delivereth from death."));
ensuperobject.biblemap.put("b20_10_3", new ensuperobject(20,10,3,"The LORD will not suffer the soul of the righteous to famish: but he casteth away the substance of the wicked."));
ensuperobject.biblemap.put("b20_10_4", new ensuperobject(20,10,4,"He becometh poor that dealeth with a slack hand: but the hand of the diligent maketh rich."));
ensuperobject.biblemap.put("b20_10_5", new ensuperobject(20,10,5,"He that gathereth in summer is a wise son: but he that sleepeth in harvest is a son that causeth shame."));
ensuperobject.biblemap.put("b20_10_6", new ensuperobject(20,10,6,"Blessings are upon the head of the just: but violence covereth the mouth of the wicked."));
ensuperobject.biblemap.put("b20_10_7", new ensuperobject(20,10,7,"The memory of the just is blessed: but the name of the wicked shall rot."));
ensuperobject.biblemap.put("b20_10_8", new ensuperobject(20,10,8,"The wise in heart will receive commandments: but a prating fool shall fall."));
ensuperobject.biblemap.put("b20_10_9", new ensuperobject(20,10,9,"He that walketh uprightly walketh surely: but he that perverteth his ways shall be known."));
ensuperobject.biblemap.put("b20_10_10", new ensuperobject(20,10,10,"He that winketh with the eye causeth sorrow: but a prating fool shall fall."));
ensuperobject.biblemap.put("b20_10_11", new ensuperobject(20,10,11,"The mouth of a righteous man is a well of life: but violence covereth the mouth of the wicked."));
ensuperobject.biblemap.put("b20_10_12", new ensuperobject(20,10,12,"Hatred stirreth up strifes: but love covereth all sins."));
ensuperobject.biblemap.put("b20_10_13", new ensuperobject(20,10,13,"In the lips of him that hath understanding wisdom is found: but a rod is for the back of him that is void of understanding."));
ensuperobject.biblemap.put("b20_10_14", new ensuperobject(20,10,14,"Wise men lay up knowledge: but the mouth of the foolish is near destruction."));
ensuperobject.biblemap.put("b20_10_15", new ensuperobject(20,10,15,"The rich man's wealth is his strong city: the destruction of the poor is their poverty."));
ensuperobject.biblemap.put("b20_10_16", new ensuperobject(20,10,16,"The labour of the righteous tendeth to life: the fruit of the wicked to sin."));
ensuperobject.biblemap.put("b20_10_17", new ensuperobject(20,10,17,"He is in the way of life that keepeth instruction: but he that refuseth reproof erreth."));
ensuperobject.biblemap.put("b20_10_18", new ensuperobject(20,10,18,"He that hideth hatred with lying lips, and he that uttereth a slander, is a fool."));
ensuperobject.biblemap.put("b20_10_19", new ensuperobject(20,10,19,"In the multitude of words there wanteth not sin: but he that refraineth his lips is wise."));
ensuperobject.biblemap.put("b20_10_20", new ensuperobject(20,10,20,"The tongue of the just is as choice silver: the heart of the wicked is little worth."));
ensuperobject.biblemap.put("b20_10_21", new ensuperobject(20,10,21,"The lips of the righteous feed many: but fools die for want of wisdom."));
ensuperobject.biblemap.put("b20_10_22", new ensuperobject(20,10,22,"The blessing of the LORD, it maketh rich, and he addeth no sorrow with it."));
ensuperobject.biblemap.put("b20_10_23", new ensuperobject(20,10,23,"It is as sport to a fool to do mischief: but a man of understanding hath wisdom."));
ensuperobject.biblemap.put("b20_10_24", new ensuperobject(20,10,24,"The fear of the wicked, it shall come upon him: but the desire of the righteous shall be granted."));
ensuperobject.biblemap.put("b20_10_25", new ensuperobject(20,10,25,"As the whirlwind passeth, so is the wicked no more: but the righteous is an everlasting foundation."));
ensuperobject.biblemap.put("b20_10_26", new ensuperobject(20,10,26,"As vinegar to the teeth, and as smoke to the eyes, so is the sluggard to them that send him."));
ensuperobject.biblemap.put("b20_10_27", new ensuperobject(20,10,27,"The fear of the LORD prolongeth days: but the years of the wicked shall be shortened."));
ensuperobject.biblemap.put("b20_10_28", new ensuperobject(20,10,28,"The hope of the righteous shall be gladness: but the expectation of the wicked shall perish."));
ensuperobject.biblemap.put("b20_10_29", new ensuperobject(20,10,29,"The way of the LORD is strength to the upright: but destruction shall be to the workers of iniquity."));
ensuperobject.biblemap.put("b20_10_30", new ensuperobject(20,10,30,"The righteous shall never be removed: but the wicked shall not inhabit the earth."));
ensuperobject.biblemap.put("b20_10_31", new ensuperobject(20,10,31,"The mouth of the just bringeth forth wisdom: but the froward tongue shall be cut out."));
ensuperobject.biblemap.put("b20_10_32", new ensuperobject(20,10,32,"The lips of the righteous know what is acceptable: but the mouth of the wicked speaketh frowardness."));
ensuperobject.biblemap.put("b20_11_1", new ensuperobject(20,11,1,"A false balance is abomination to the LORD: but a just weight is his delight."));
ensuperobject.biblemap.put("b20_11_2", new ensuperobject(20,11,2,"When pride cometh, then cometh shame: but with the lowly is wisdom."));
ensuperobject.biblemap.put("b20_11_3", new ensuperobject(20,11,3,"The integrity of the upright shall guide them: but the perverseness of transgressors shall destroy them."));
ensuperobject.biblemap.put("b20_11_4", new ensuperobject(20,11,4,"Riches profit not in the day of wrath: but righteousness delivereth from death."));
ensuperobject.biblemap.put("b20_11_5", new ensuperobject(20,11,5,"The righteousness of the perfect shall direct his way: but the wicked shall fall by his own wickedness."));
ensuperobject.biblemap.put("b20_11_6", new ensuperobject(20,11,6,"The righteousness of the upright shall deliver them: but transgressors shall be taken in their own naughtiness."));
ensuperobject.biblemap.put("b20_11_7", new ensuperobject(20,11,7,"When a wicked man dieth, his expectation shall perish: and the hope of unjust men perisheth."));
ensuperobject.biblemap.put("b20_11_8", new ensuperobject(20,11,8,"The righteous is delivered out of trouble, and the wicked cometh in his stead."));
ensuperobject.biblemap.put("b20_11_9", new ensuperobject(20,11,9,"An hypocrite with his mouth destroyeth his neighbour: but through knowledge shall the just be delivered."));
ensuperobject.biblemap.put("b20_11_10", new ensuperobject(20,11,10,"When it goeth well with the righteous, the city rejoiceth: and when the wicked perish, there is shouting."));
ensuperobject.biblemap.put("b20_11_11", new ensuperobject(20,11,11,"By the blessing of the upright the city is exalted: but it is overthrown by the mouth of the wicked."));
ensuperobject.biblemap.put("b20_11_12", new ensuperobject(20,11,12,"He that is void of wisdom despiseth his neighbour: but a man of understanding holdeth his peace."));
ensuperobject.biblemap.put("b20_11_13", new ensuperobject(20,11,13,"A talebearer revealeth secrets: but he that is of a faithful spirit concealeth the matter."));
ensuperobject.biblemap.put("b20_11_14", new ensuperobject(20,11,14,"Where no counsel is, the people fall: but in the multitude of counsellors there is safety."));
ensuperobject.biblemap.put("b20_11_15", new ensuperobject(20,11,15,"He that is surety for a stranger shall smart for it: and he that hateth suretiship is sure."));
ensuperobject.biblemap.put("b20_11_16", new ensuperobject(20,11,16,"A gracious woman retaineth honour: and strong men retain riches."));
ensuperobject.biblemap.put("b20_11_17", new ensuperobject(20,11,17,"The merciful man doeth good to his own soul: but he that is cruel troubleth his own flesh."));
ensuperobject.biblemap.put("b20_11_18", new ensuperobject(20,11,18,"The wicked worketh a deceitful work: but to him that soweth righteousness shall be a sure reward."));
ensuperobject.biblemap.put("b20_11_19", new ensuperobject(20,11,19,"As righteousness tendeth to life: so he that pursueth evil pursueth it to his own death."));
ensuperobject.biblemap.put("b20_11_20", new ensuperobject(20,11,20,"They that are of a froward heart are abomination to the LORD: but such as are upright in their way are his delight."));
ensuperobject.biblemap.put("b20_11_21", new ensuperobject(20,11,21,"Though hand join in hand, the wicked shall not be unpunished: but the seed of the righteous shall be delivered."));
ensuperobject.biblemap.put("b20_11_22", new ensuperobject(20,11,22,"As a jewel of gold in a swine's snout, so is a fair woman which is without discretion."));
ensuperobject.biblemap.put("b20_11_23", new ensuperobject(20,11,23,"The desire of the righteous is only good: but the expectation of the wicked is wrath."));
ensuperobject.biblemap.put("b20_11_24", new ensuperobject(20,11,24,"There is that scattereth, and yet increaseth; and there is that withholdeth more than is meet, but it tendeth to poverty."));
ensuperobject.biblemap.put("b20_11_25", new ensuperobject(20,11,25,"The liberal soul shall be made fat: and he that watereth shall be watered also himself."));
ensuperobject.biblemap.put("b20_11_26", new ensuperobject(20,11,26,"He that withholdeth corn, the people shall curse him: but blessing shall be upon the head of him that selleth it."));
ensuperobject.biblemap.put("b20_11_27", new ensuperobject(20,11,27,"He that diligently seeketh good procureth favour: but he that seeketh mischief, it shall come unto him."));
ensuperobject.biblemap.put("b20_11_28", new ensuperobject(20,11,28,"He that trusteth in his riches shall fall; but the righteous shall flourish as a branch."));
ensuperobject.biblemap.put("b20_11_29", new ensuperobject(20,11,29,"He that troubleth his own house shall inherit the wind: and the fool shall be servant to the wise of heart."));
ensuperobject.biblemap.put("b20_11_30", new ensuperobject(20,11,30,"The fruit of the righteous is a tree of life; and he that winneth souls is wise."));
ensuperobject.biblemap.put("b20_11_31", new ensuperobject(20,11,31,"Behold, the righteous shall be recompensed in the earth: much more the wicked and the sinner."));
ensuperobject.biblemap.put("b20_12_1", new ensuperobject(20,12,1,"Whoso loveth instruction loveth knowledge: but he that hateth reproof is brutish."));
ensuperobject.biblemap.put("b20_12_2", new ensuperobject(20,12,2,"A good man obtaineth favour of the LORD: but a man of wicked devices will he condemn."));
ensuperobject.biblemap.put("b20_12_3", new ensuperobject(20,12,3,"A man shall not be established by wickedness: but the root of the righteous shall not be moved."));
ensuperobject.biblemap.put("b20_12_4", new ensuperobject(20,12,4,"A virtuous woman is a crown to her husband: but she that maketh ashamed is as rottenness in his bones."));
ensuperobject.biblemap.put("b20_12_5", new ensuperobject(20,12,5,"The thoughts of the righteous are right: but the counsels of the wicked are deceit."));
ensuperobject.biblemap.put("b20_12_6", new ensuperobject(20,12,6,"The words of the wicked are to lie in wait for blood: but the mouth of the upright shall deliver them."));
ensuperobject.biblemap.put("b20_12_7", new ensuperobject(20,12,7,"The wicked are overthrown, and are not: but the house of the righteous shall stand."));
ensuperobject.biblemap.put("b20_12_8", new ensuperobject(20,12,8,"A man shall be commended according to his wisdom: but he that is of a perverse heart shall be despised."));
ensuperobject.biblemap.put("b20_12_9", new ensuperobject(20,12,9,"He that is despised, and hath a servant, is better than he that honoureth himself, and lacketh bread."));
ensuperobject.biblemap.put("b20_12_10", new ensuperobject(20,12,10,"A righteous man regardeth the life of his beast: but the tender mercies of the wicked are cruel."));
ensuperobject.biblemap.put("b20_12_11", new ensuperobject(20,12,11,"He that tilleth his land shall be satisfied with bread: but he that followeth vain persons is void of understanding."));
ensuperobject.biblemap.put("b20_12_12", new ensuperobject(20,12,12,"The wicked desireth the net of evil men: but the root of the righteous yieldeth fruit."));
ensuperobject.biblemap.put("b20_12_13", new ensuperobject(20,12,13,"The wicked is snared by the transgression of his lips: but the just shall come out of trouble."));
ensuperobject.biblemap.put("b20_12_14", new ensuperobject(20,12,14,"A man shall be satisfied with good by the fruit of his mouth: and the recompence of a man's hands shall be rendered unto him."));
ensuperobject.biblemap.put("b20_12_15", new ensuperobject(20,12,15,"The way of a fool is right in his own eyes: but he that hearkeneth unto counsel is wise."));
ensuperobject.biblemap.put("b20_12_16", new ensuperobject(20,12,16,"A fool's wrath is presently known: but a prudent man covereth shame."));
ensuperobject.biblemap.put("b20_12_17", new ensuperobject(20,12,17,"He that speaketh truth sheweth forth righteousness: but a false witness deceit."));
ensuperobject.biblemap.put("b20_12_18", new ensuperobject(20,12,18,"There is that speaketh like the piercings of a sword: but the tongue of the wise is health."));
ensuperobject.biblemap.put("b20_12_19", new ensuperobject(20,12,19,"The lip of truth shall be established for ever: but a lying tongue is but for a moment."));
ensuperobject.biblemap.put("b20_12_20", new ensuperobject(20,12,20,"Deceit is in the heart of them that imagine evil: but to the counsellors of peace is joy."));
ensuperobject.biblemap.put("b20_12_21", new ensuperobject(20,12,21,"There shall no evil happen to the just: but the wicked shall be filled with mischief."));
ensuperobject.biblemap.put("b20_12_22", new ensuperobject(20,12,22,"Lying lips are abomination to the LORD: but they that deal truly are his delight."));
ensuperobject.biblemap.put("b20_12_23", new ensuperobject(20,12,23,"A prudent man concealeth knowledge: but the heart of fools proclaimeth foolishness."));
ensuperobject.biblemap.put("b20_12_24", new ensuperobject(20,12,24,"The hand of the diligent shall bear rule: but the slothful shall be under tribute."));
ensuperobject.biblemap.put("b20_12_25", new ensuperobject(20,12,25,"Heaviness in the heart of man maketh it stoop: but a good word maketh it glad."));
ensuperobject.biblemap.put("b20_12_26", new ensuperobject(20,12,26,"The righteous is more excellent than his neighbour: but the way of the wicked seduceth them."));
ensuperobject.biblemap.put("b20_12_27", new ensuperobject(20,12,27,"The slothful man roasteth not that which he took in hunting: but the substance of a diligent man is precious."));
ensuperobject.biblemap.put("b20_12_28", new ensuperobject(20,12,28,"In the way of righteousness is life: and in the pathway thereof there is no death."));
ensuperobject.biblemap.put("b20_13_1", new ensuperobject(20,13,1,"A wise son heareth his father's instruction: but a scorner heareth not rebuke."));
ensuperobject.biblemap.put("b20_13_2", new ensuperobject(20,13,2,"A man shall eat good by the fruit of his mouth: but the soul of the transgressors shall eat violence."));
ensuperobject.biblemap.put("b20_13_3", new ensuperobject(20,13,3,"He that keepeth his mouth keepeth his life: but he that openeth wide his lips shall have destruction."));
ensuperobject.biblemap.put("b20_13_4", new ensuperobject(20,13,4,"The soul of the sluggard desireth, and hath nothing: but the soul of the diligent shall be made fat."));
ensuperobject.biblemap.put("b20_13_5", new ensuperobject(20,13,5,"A righteous man hateth lying: but a wicked man is loathsome, and cometh to shame."));
ensuperobject.biblemap.put("b20_13_6", new ensuperobject(20,13,6,"Righteousness keepeth him that is upright in the way: but wickedness overthroweth the sinner."));
ensuperobject.biblemap.put("b20_13_7", new ensuperobject(20,13,7,"There is that maketh himself rich, yet hath nothing: there is that maketh himself poor, yet hath great riches."));
ensuperobject.biblemap.put("b20_13_8", new ensuperobject(20,13,8,"The ransom of a man's life are his riches: but the poor heareth not rebuke."));
ensuperobject.biblemap.put("b20_13_9", new ensuperobject(20,13,9,"The light of the righteous rejoiceth: but the lamp of the wicked shall be put out."));
ensuperobject.biblemap.put("b20_13_10", new ensuperobject(20,13,10,"Only by pride cometh contention: but with the well advised is wisdom."));
ensuperobject.biblemap.put("b20_13_11", new ensuperobject(20,13,11,"Wealth gotten by vanity shall be diminished: but he that gathereth by labour shall increase."));
ensuperobject.biblemap.put("b20_13_12", new ensuperobject(20,13,12,"Hope deferred maketh the heart sick: but when the desire cometh, it is a tree of life."));
ensuperobject.biblemap.put("b20_13_13", new ensuperobject(20,13,13,"Whoso despiseth the word shall be destroyed: but he that feareth the commandment shall be rewarded."));
ensuperobject.biblemap.put("b20_13_14", new ensuperobject(20,13,14,"The law of the wise is a fountain of life, to depart from the snares of death."));
ensuperobject.biblemap.put("b20_13_15", new ensuperobject(20,13,15,"Good understanding giveth favour: but the way of transgressors is hard."));
ensuperobject.biblemap.put("b20_13_16", new ensuperobject(20,13,16,"Every prudent man dealeth with knowledge: but a fool layeth open his folly."));
ensuperobject.biblemap.put("b20_13_17", new ensuperobject(20,13,17,"A wicked messenger falleth into mischief: but a faithful ambassador is health."));
ensuperobject.biblemap.put("b20_13_18", new ensuperobject(20,13,18,"Poverty and shame shall be to him that refuseth instruction: but he that regardeth reproof shall be honoured."));
ensuperobject.biblemap.put("b20_13_19", new ensuperobject(20,13,19,"The desire accomplished is sweet to the soul: but it is abomination to fools to depart from evil."));
ensuperobject.biblemap.put("b20_13_20", new ensuperobject(20,13,20,"He that walketh with wise men shall be wise: but a companion of fools shall be destroyed."));
ensuperobject.biblemap.put("b20_13_21", new ensuperobject(20,13,21,"Evil pursueth sinners: but to the righteous good shall be repayed."));
ensuperobject.biblemap.put("b20_13_22", new ensuperobject(20,13,22,"A good man leaveth an inheritance to his children's children: and the wealth of the sinner is laid up for the just."));
ensuperobject.biblemap.put("b20_13_23", new ensuperobject(20,13,23,"Much food is in the tillage of the poor: but there is that is destroyed for want of judgment."));
ensuperobject.biblemap.put("b20_13_24", new ensuperobject(20,13,24,"He that spareth his rod hateth his son: but he that loveth him chasteneth him betimes."));
ensuperobject.biblemap.put("b20_13_25", new ensuperobject(20,13,25,"The righteous eateth to the satisfying of his soul: but the belly of the wicked shall want."));
ensuperobject.biblemap.put("b20_14_1", new ensuperobject(20,14,1,"Every wise woman buildeth her house: but the foolish plucketh it down with her hands."));
ensuperobject.biblemap.put("b20_14_2", new ensuperobject(20,14,2,"He that walketh in his uprightness feareth the LORD: but he that is perverse in his ways despiseth him."));
ensuperobject.biblemap.put("b20_14_3", new ensuperobject(20,14,3,"In the mouth of the foolish is a rod of pride: but the lips of the wise shall preserve them."));
ensuperobject.biblemap.put("b20_14_4", new ensuperobject(20,14,4,"Where no oxen are, the crib is clean: but much increase is by the strength of the ox."));
ensuperobject.biblemap.put("b20_14_5", new ensuperobject(20,14,5,"A faithful witness will not lie: but a false witness will utter lies."));
ensuperobject.biblemap.put("b20_14_6", new ensuperobject(20,14,6,"A scorner seeketh wisdom, and findeth it not: but knowledge is easy unto him that understandeth."));
ensuperobject.biblemap.put("b20_14_7", new ensuperobject(20,14,7,"Go from the presence of a foolish man, when thou perceivest not in him the lips of knowledge."));
ensuperobject.biblemap.put("b20_14_8", new ensuperobject(20,14,8,"The wisdom of the prudent is to understand his way: but the folly of fools is deceit."));
ensuperobject.biblemap.put("b20_14_9", new ensuperobject(20,14,9,"Fools make a mock at sin: but among the righteous there is favour."));
ensuperobject.biblemap.put("b20_14_10", new ensuperobject(20,14,10,"The heart knoweth his own bitterness; and a stranger doth not intermeddle with his joy."));
ensuperobject.biblemap.put("b20_14_11", new ensuperobject(20,14,11,"The house of the wicked shall be overthrown: but the tabernacle of the upright shall flourish."));
ensuperobject.biblemap.put("b20_14_12", new ensuperobject(20,14,12,"There is a way which seemeth right unto a man, but the end thereof are the ways of death."));
ensuperobject.biblemap.put("b20_14_13", new ensuperobject(20,14,13,"Even in laughter the heart is sorrowful; and the end of that mirth is heaviness."));
ensuperobject.biblemap.put("b20_14_14", new ensuperobject(20,14,14,"The backslider in heart shall be filled with his own ways: and a good man shall be satisfied from himself."));
ensuperobject.biblemap.put("b20_14_15", new ensuperobject(20,14,15,"The simple believeth every word: but the prudent man looketh well to his going."));
ensuperobject.biblemap.put("b20_14_16", new ensuperobject(20,14,16,"A wise man feareth, and departeth from evil: but the fool rageth, and is confident."));
ensuperobject.biblemap.put("b20_14_17", new ensuperobject(20,14,17,"He that is soon angry dealeth foolishly: and a man of wicked devices is hated."));
ensuperobject.biblemap.put("b20_14_18", new ensuperobject(20,14,18,"The simple inherit folly: but the prudent are crowned with knowledge."));
ensuperobject.biblemap.put("b20_14_19", new ensuperobject(20,14,19,"The evil bow before the good; and the wicked at the gates of the righteous."));
ensuperobject.biblemap.put("b20_14_20", new ensuperobject(20,14,20,"The poor is hated even of his own neighbour: but the rich hath many friends."));
ensuperobject.biblemap.put("b20_14_21", new ensuperobject(20,14,21,"He that despiseth his neighbour sinneth: but he that hath mercy on the poor, happy is he."));
ensuperobject.biblemap.put("b20_14_22", new ensuperobject(20,14,22,"Do they not err that devise evil? but mercy and truth shall be to them that devise good."));
ensuperobject.biblemap.put("b20_14_23", new ensuperobject(20,14,23,"In all labour there is profit: but the talk of the lips tendeth only to penury."));
ensuperobject.biblemap.put("b20_14_24", new ensuperobject(20,14,24,"The crown of the wise is their riches: but the foolishness of fools is folly."));
ensuperobject.biblemap.put("b20_14_25", new ensuperobject(20,14,25,"A true witness delivereth souls: but a deceitful witness speaketh lies."));
ensuperobject.biblemap.put("b20_14_26", new ensuperobject(20,14,26,"In the fear of the LORD is strong confidence: and his children shall have a place of refuge."));
ensuperobject.biblemap.put("b20_14_27", new ensuperobject(20,14,27,"The fear of the LORD is a fountain of life, to depart from the snares of death."));
ensuperobject.biblemap.put("b20_14_28", new ensuperobject(20,14,28,"In the multitude of people is the king's honour: but in the want of people is the destruction of the prince."));
ensuperobject.biblemap.put("b20_14_29", new ensuperobject(20,14,29,"He that is slow to wrath is of great understanding: but he that is hasty of spirit exalteth folly."));
ensuperobject.biblemap.put("b20_14_30", new ensuperobject(20,14,30,"A sound heart is the life of the flesh: but envy the rottenness of the bones."));
ensuperobject.biblemap.put("b20_14_31", new ensuperobject(20,14,31,"He that oppresseth the poor reproacheth his Maker: but he that honoureth him hath mercy on the poor."));
ensuperobject.biblemap.put("b20_14_32", new ensuperobject(20,14,32,"The wicked is driven away in his wickedness: but the righteous hath hope in his death."));
ensuperobject.biblemap.put("b20_14_33", new ensuperobject(20,14,33,"Wisdom resteth in the heart of him that hath understanding: but that which is in the midst of fools is made known."));
ensuperobject.biblemap.put("b20_14_34", new ensuperobject(20,14,34,"Righteousness exalteth a nation: but sin is a reproach to any people."));
ensuperobject.biblemap.put("b20_14_35", new ensuperobject(20,14,35,"The king's favour is toward a wise servant: but his wrath is against him that causeth shame."));
ensuperobject.biblemap.put("b20_15_1", new ensuperobject(20,15,1,"A soft answer turneth away wrath: but grievous words stir up anger."));
ensuperobject.biblemap.put("b20_15_2", new ensuperobject(20,15,2,"The tongue of the wise useth knowledge aright: but the mouth of fools poureth out foolishness."));
ensuperobject.biblemap.put("b20_15_3", new ensuperobject(20,15,3,"The eyes of the LORD are in every place, beholding the evil and the good."));
ensuperobject.biblemap.put("b20_15_4", new ensuperobject(20,15,4,"A wholesome tongue is a tree of life: but perverseness therein is a breach in the spirit."));
ensuperobject.biblemap.put("b20_15_5", new ensuperobject(20,15,5,"A fool despiseth his father's instruction: but he that regardeth reproof is prudent."));
ensuperobject.biblemap.put("b20_15_6", new ensuperobject(20,15,6,"In the house of the righteous is much treasure: but in the revenues of the wicked is trouble."));
ensuperobject.biblemap.put("b20_15_7", new ensuperobject(20,15,7,"The lips of the wise disperse knowledge: but the heart of the foolish doeth not so."));
ensuperobject.biblemap.put("b20_15_8", new ensuperobject(20,15,8,"The sacrifice of the wicked is an abomination to the LORD: but the prayer of the upright is his delight."));
ensuperobject.biblemap.put("b20_15_9", new ensuperobject(20,15,9,"The way of the wicked is an abomination unto the LORD: but he loveth him that followeth after righteousness."));
ensuperobject.biblemap.put("b20_15_10", new ensuperobject(20,15,10,"Correction is grievous unto him that forsaketh the way: and he that hateth reproof shall die."));
ensuperobject.biblemap.put("b20_15_11", new ensuperobject(20,15,11,"Hell and destruction are before the LORD: how much more then the hearts of the children of men?"));
ensuperobject.biblemap.put("b20_15_12", new ensuperobject(20,15,12,"A scorner loveth not one that reproveth him: neither will he go unto the wise."));
ensuperobject.biblemap.put("b20_15_13", new ensuperobject(20,15,13,"A merry heart maketh a cheerful countenance: but by sorrow of the heart the spirit is broken."));
ensuperobject.biblemap.put("b20_15_14", new ensuperobject(20,15,14,"The heart of him that hath understanding seeketh knowledge: but the mouth of fools feedeth on foolishness."));
ensuperobject.biblemap.put("b20_15_15", new ensuperobject(20,15,15,"All the days of the afflicted are evil: but he that is of a merry heart hath a continual feast."));
ensuperobject.biblemap.put("b20_15_16", new ensuperobject(20,15,16,"Better is little with the fear of the LORD than great treasure and trouble therewith."));
ensuperobject.biblemap.put("b20_15_17", new ensuperobject(20,15,17,"Better is a dinner of herbs where love is, than a stalled ox and hatred therewith."));
ensuperobject.biblemap.put("b20_15_18", new ensuperobject(20,15,18,"A wrathful man stirreth up strife: but he that is slow to anger appeaseth strife."));
ensuperobject.biblemap.put("b20_15_19", new ensuperobject(20,15,19,"The way of the slothful man is as an hedge of thorns: but the way of the righteous is made plain."));
ensuperobject.biblemap.put("b20_15_20", new ensuperobject(20,15,20,"A wise son maketh a glad father: but a foolish man despiseth his mother."));
ensuperobject.biblemap.put("b20_15_21", new ensuperobject(20,15,21,"Folly is joy to him that is destitute of wisdom: but a man of understanding walketh uprightly."));
ensuperobject.biblemap.put("b20_15_22", new ensuperobject(20,15,22,"Without counsel purposes are disappointed: but in the multitude of counsellors they are established."));
ensuperobject.biblemap.put("b20_15_23", new ensuperobject(20,15,23,"A man hath joy by the answer of his mouth: and a word spoken in due season, how good is it!"));
ensuperobject.biblemap.put("b20_15_24", new ensuperobject(20,15,24,"The way of life is above to the wise, that he may depart from hell beneath."));
ensuperobject.biblemap.put("b20_15_25", new ensuperobject(20,15,25,"The LORD will destroy the house of the proud: but he will establish the border of the widow."));
ensuperobject.biblemap.put("b20_15_26", new ensuperobject(20,15,26,"The thoughts of the wicked are an abomination to the LORD: but the words of the pure are pleasant words."));
ensuperobject.biblemap.put("b20_15_27", new ensuperobject(20,15,27,"He that is greedy of gain troubleth his own house; but he that hateth gifts shall live."));
ensuperobject.biblemap.put("b20_15_28", new ensuperobject(20,15,28,"The heart of the righteous studieth to answer: but the mouth of the wicked poureth out evil things."));
ensuperobject.biblemap.put("b20_15_29", new ensuperobject(20,15,29,"The LORD is far from the wicked: but he heareth the prayer of the righteous."));
ensuperobject.biblemap.put("b20_15_30", new ensuperobject(20,15,30,"The light of the eyes rejoiceth the heart: and a good report maketh the bones fat."));
ensuperobject.biblemap.put("b20_15_31", new ensuperobject(20,15,31,"The ear that heareth the reproof of life abideth among the wise."));
ensuperobject.biblemap.put("b20_15_32", new ensuperobject(20,15,32,"He that refuseth instruction despiseth his own soul: but he that heareth reproof getteth understanding."));
ensuperobject.biblemap.put("b20_15_33", new ensuperobject(20,15,33,"The fear of the LORD is the instruction of wisdom; and before honour is humility."));
ensuperobject.biblemap.put("b20_16_1", new ensuperobject(20,16,1,"The preparations of the heart in man, and the answer of the tongue, is from the LORD."));
ensuperobject.biblemap.put("b20_16_2", new ensuperobject(20,16,2,"All the ways of a man are clean in his own eyes; but the LORD weigheth the spirits."));
ensuperobject.biblemap.put("b20_16_3", new ensuperobject(20,16,3,"Commit thy works unto the LORD, and thy thoughts shall be established."));
ensuperobject.biblemap.put("b20_16_4", new ensuperobject(20,16,4,"The LORD hath made all things for himself: yea, even the wicked for the day of evil."));
ensuperobject.biblemap.put("b20_16_5", new ensuperobject(20,16,5,"Every one that is proud in heart is an abomination to the LORD: though hand join in hand, he shall not be unpunished."));
ensuperobject.biblemap.put("b20_16_6", new ensuperobject(20,16,6,"By mercy and truth iniquity is purged: and by the fear of the LORD men depart from evil."));
ensuperobject.biblemap.put("b20_16_7", new ensuperobject(20,16,7,"When a man's ways please the LORD, he maketh even his enemies to be at peace with him."));
ensuperobject.biblemap.put("b20_16_8", new ensuperobject(20,16,8,"Better is a little with righteousness than great revenues without right."));
ensuperobject.biblemap.put("b20_16_9", new ensuperobject(20,16,9,"A man's heart deviseth his way: but the LORD directeth his steps."));
ensuperobject.biblemap.put("b20_16_10", new ensuperobject(20,16,10,"A divine sentence is in the lips of the king: his mouth transgresseth not in judgment."));
ensuperobject.biblemap.put("b20_16_11", new ensuperobject(20,16,11,"A just weight and balance are the LORD's: all the weights of the bag are his work."));
ensuperobject.biblemap.put("b20_16_12", new ensuperobject(20,16,12,"It is an abomination to kings to commit wickedness: for the throne is established by righteousness."));
ensuperobject.biblemap.put("b20_16_13", new ensuperobject(20,16,13,"Righteous lips are the delight of kings; and they love him that speaketh right."));
ensuperobject.biblemap.put("b20_16_14", new ensuperobject(20,16,14,"The wrath of a king is as messengers of death: but a wise man will pacify it."));
ensuperobject.biblemap.put("b20_16_15", new ensuperobject(20,16,15,"In the light of the king's countenance is life; and his favour is as a cloud of the latter rain."));
ensuperobject.biblemap.put("b20_16_16", new ensuperobject(20,16,16,"How much better is it to get wisdom than gold! and to get understanding rather to be chosen than silver!"));
ensuperobject.biblemap.put("b20_16_17", new ensuperobject(20,16,17,"The highway of the upright is to depart from evil: he that keepeth his way preserveth his soul."));
ensuperobject.biblemap.put("b20_16_18", new ensuperobject(20,16,18,"Pride goeth before destruction, and an haughty spirit before a fall."));
ensuperobject.biblemap.put("b20_16_19", new ensuperobject(20,16,19,"Better it is to be of an humble spirit with the lowly, than to divide the spoil with the proud."));
ensuperobject.biblemap.put("b20_16_20", new ensuperobject(20,16,20,"He that handleth a matter wisely shall find good: and whoso trusteth in the LORD, happy is he."));
ensuperobject.biblemap.put("b20_16_21", new ensuperobject(20,16,21,"The wise in heart shall be called prudent: and the sweetness of the lips increaseth learning."));
ensuperobject.biblemap.put("b20_16_22", new ensuperobject(20,16,22,"Understanding is a wellspring of life unto him that hath it: but the instruction of fools is folly."));
ensuperobject.biblemap.put("b20_16_23", new ensuperobject(20,16,23,"The heart of the wise teacheth his mouth, and addeth learning to his lips."));
ensuperobject.biblemap.put("b20_16_24", new ensuperobject(20,16,24,"Pleasant words are as an honeycomb, sweet to the soul, and health to the bones."));
ensuperobject.biblemap.put("b20_16_25", new ensuperobject(20,16,25,"There is a way that seemeth right unto a man, but the end thereof are the ways of death."));
ensuperobject.biblemap.put("b20_16_26", new ensuperobject(20,16,26,"He that laboureth laboureth for himself; for his mouth craveth it of him."));
ensuperobject.biblemap.put("b20_16_27", new ensuperobject(20,16,27,"An ungodly man diggeth up evil: and in his lips there is as a burning fire."));
ensuperobject.biblemap.put("b20_16_28", new ensuperobject(20,16,28,"A froward man soweth strife: and a whisperer separateth chief friends."));
ensuperobject.biblemap.put("b20_16_29", new ensuperobject(20,16,29,"A violent man enticeth his neighbour, and leadeth him into the way that is not good."));
ensuperobject.biblemap.put("b20_16_30", new ensuperobject(20,16,30,"He shutteth his eyes to devise froward things: moving his lips he bringeth evil to pass."));
ensuperobject.biblemap.put("b20_16_31", new ensuperobject(20,16,31,"The hoary head is a crown of glory, if it be found in the way of righteousness."));
ensuperobject.biblemap.put("b20_16_32", new ensuperobject(20,16,32,"He that is slow to anger is better than the mighty; and he that ruleth his spirit than he that taketh a city."));
ensuperobject.biblemap.put("b20_16_33", new ensuperobject(20,16,33,"The lot is cast into the lap; but the whole disposing thereof is of the LORD."));
ensuperobject.biblemap.put("b20_17_1", new ensuperobject(20,17,1,"Better is a dry morsel, and quietness therewith, than an house full of sacrifices with strife."));
ensuperobject.biblemap.put("b20_17_2", new ensuperobject(20,17,2,"A wise servant shall have rule over a son that causeth shame, and shall have part of the inheritance among the brethren."));
ensuperobject.biblemap.put("b20_17_3", new ensuperobject(20,17,3,"The fining pot is for silver, and the furnace for gold: but the LORD trieth the hearts."));
ensuperobject.biblemap.put("b20_17_4", new ensuperobject(20,17,4,"A wicked doer giveth heed to false lips; and a liar giveth ear to a naughty tongue."));
ensuperobject.biblemap.put("b20_17_5", new ensuperobject(20,17,5,"Whoso mocketh the poor reproacheth his Maker: and he that is glad at calamities shall not be unpunished."));
ensuperobject.biblemap.put("b20_17_6", new ensuperobject(20,17,6,"Children's children are the crown of old men; and the glory of children are their fathers."));
ensuperobject.biblemap.put("b20_17_7", new ensuperobject(20,17,7,"Excellent speech becometh not a fool: much less do lying lips a prince."));
ensuperobject.biblemap.put("b20_17_8", new ensuperobject(20,17,8,"A gift is as a precious stone in the eyes of him that hath it: whithersoever it turneth, it prospereth."));
ensuperobject.biblemap.put("b20_17_9", new ensuperobject(20,17,9,"He that covereth a transgression seeketh love; but he that repeateth a matter separateth very friends."));
ensuperobject.biblemap.put("b20_17_10", new ensuperobject(20,17,10,"A reproof entereth more into a wise man than an hundred stripes into a fool."));
ensuperobject.biblemap.put("b20_17_11", new ensuperobject(20,17,11,"An evil man seeketh only rebellion: therefore a cruel messenger shall be sent against him."));
ensuperobject.biblemap.put("b20_17_12", new ensuperobject(20,17,12,"Let a bear robbed of her whelps meet a man, rather than a fool in his folly."));
ensuperobject.biblemap.put("b20_17_13", new ensuperobject(20,17,13,"Whoso rewardeth evil for good, evil shall not depart from his house."));
ensuperobject.biblemap.put("b20_17_14", new ensuperobject(20,17,14,"The beginning of strife is as when one letteth out water: therefore leave off contention, before it be meddled with."));
ensuperobject.biblemap.put("b20_17_15", new ensuperobject(20,17,15,"He that justifieth the wicked, and he that condemneth the just, even they both are abomination to the LORD."));
ensuperobject.biblemap.put("b20_17_16", new ensuperobject(20,17,16,"Wherefore is there a price in the hand of a fool to get wisdom, seeing he hath no heart to it?"));
ensuperobject.biblemap.put("b20_17_17", new ensuperobject(20,17,17,"A friend loveth at all times, and a brother is born for adversity."));
ensuperobject.biblemap.put("b20_17_18", new ensuperobject(20,17,18,"A man void of understanding striketh hands, and becometh surety in the presence of his friend."));
ensuperobject.biblemap.put("b20_17_19", new ensuperobject(20,17,19,"He loveth transgression that loveth strife: and he that exalteth his gate seeketh destruction."));
ensuperobject.biblemap.put("b20_17_20", new ensuperobject(20,17,20,"He that hath a froward heart findeth no good: and he that hath a perverse tongue falleth into mischief."));
ensuperobject.biblemap.put("b20_17_21", new ensuperobject(20,17,21,"He that begetteth a fool doeth it to his sorrow: and the father of a fool hath no joy."));
ensuperobject.biblemap.put("b20_17_22", new ensuperobject(20,17,22,"A merry heart doeth good like a medicine: but a broken spirit drieth the bones."));
ensuperobject.biblemap.put("b20_17_23", new ensuperobject(20,17,23,"A wicked man taketh a gift out of the bosom to pervert the ways of judgment."));
ensuperobject.biblemap.put("b20_17_24", new ensuperobject(20,17,24,"Wisdom is before him that hath understanding; but the eyes of a fool are in the ends of the earth."));
ensuperobject.biblemap.put("b20_17_25", new ensuperobject(20,17,25,"A foolish son is a grief to his father, and bitterness to her that bare him."));
ensuperobject.biblemap.put("b20_17_26", new ensuperobject(20,17,26,"Also to punish the just is not good, nor to strike princes for equity."));
ensuperobject.biblemap.put("b20_17_27", new ensuperobject(20,17,27,"He that hath knowledge spareth his words: and a man of understanding is of an excellent spirit."));
ensuperobject.biblemap.put("b20_17_28", new ensuperobject(20,17,28,"Even a fool, when he holdeth his peace, is counted wise: and he that shutteth his lips is esteemed a man of understanding."));
ensuperobject.biblemap.put("b20_18_1", new ensuperobject(20,18,1,"Through desire a man, having separated himself, seeketh and intermeddleth with all wisdom."));
ensuperobject.biblemap.put("b20_18_2", new ensuperobject(20,18,2,"A fool hath no delight in understanding, but that his heart may discover itself."));
ensuperobject.biblemap.put("b20_18_3", new ensuperobject(20,18,3,"When the wicked cometh, then cometh also contempt, and with ignominy reproach."));
ensuperobject.biblemap.put("b20_18_4", new ensuperobject(20,18,4,"The words of a man's mouth are as deep waters, and the wellspring of wisdom as a flowing brook."));
ensuperobject.biblemap.put("b20_18_5", new ensuperobject(20,18,5,"It is not good to accept the person of the wicked, to overthrow the righteous in judgment."));
ensuperobject.biblemap.put("b20_18_6", new ensuperobject(20,18,6,"A fool's lips enter into contention, and his mouth calleth for strokes."));
ensuperobject.biblemap.put("b20_18_7", new ensuperobject(20,18,7,"A fool's mouth is his destruction, and his lips are the snare of his soul."));
ensuperobject.biblemap.put("b20_18_8", new ensuperobject(20,18,8,"The words of a talebearer are as wounds, and they go down into the innermost parts of the belly."));
ensuperobject.biblemap.put("b20_18_9", new ensuperobject(20,18,9,"He also that is slothful in his work is brother to him that is a great waster."));
ensuperobject.biblemap.put("b20_18_10", new ensuperobject(20,18,10,"The name of the LORD is a strong tower: the righteous runneth into it, and is safe."));
ensuperobject.biblemap.put("b20_18_11", new ensuperobject(20,18,11,"The rich man's wealth is his strong city, and as an high wall in his own conceit."));
ensuperobject.biblemap.put("b20_18_12", new ensuperobject(20,18,12,"Before destruction the heart of man is haughty, and before honour is humility."));
ensuperobject.biblemap.put("b20_18_13", new ensuperobject(20,18,13,"He that answereth a matter before he heareth it, it is folly and shame unto him."));
ensuperobject.biblemap.put("b20_18_14", new ensuperobject(20,18,14,"The spirit of a man will sustain his infirmity; but a wounded spirit who can bear?"));
ensuperobject.biblemap.put("b20_18_15", new ensuperobject(20,18,15,"The heart of the prudent getteth knowledge; and the ear of the wise seeketh knowledge."));
ensuperobject.biblemap.put("b20_18_16", new ensuperobject(20,18,16,"A man's gift maketh room for him, and bringeth him before great men."));
ensuperobject.biblemap.put("b20_18_17", new ensuperobject(20,18,17,"He that is first in his own cause seemeth just; but his neighbour cometh and searcheth him."));
ensuperobject.biblemap.put("b20_18_18", new ensuperobject(20,18,18,"The lot causeth contentions to cease, and parteth between the mighty."));
ensuperobject.biblemap.put("b20_18_19", new ensuperobject(20,18,19,"A brother offended is harder to be won than a strong city: and their contentions are like the bars of a castle."));
ensuperobject.biblemap.put("b20_18_20", new ensuperobject(20,18,20,"A man's belly shall be satisfied with the fruit of his mouth; and with the increase of his lips shall he be filled."));
ensuperobject.biblemap.put("b20_18_21", new ensuperobject(20,18,21,"Death and life are in the power of the tongue: and they that love it shall eat the fruit thereof."));
ensuperobject.biblemap.put("b20_18_22", new ensuperobject(20,18,22,"Whoso findeth a wife findeth a good thing, and obtaineth favour of the LORD."));
ensuperobject.biblemap.put("b20_18_23", new ensuperobject(20,18,23,"The poor useth intreaties; but the rich answereth roughly."));
ensuperobject.biblemap.put("b20_18_24", new ensuperobject(20,18,24,"A man that hath friends must shew himself friendly: and there is a friend that sticketh closer than a brother."));
ensuperobject.biblemap.put("b20_19_1", new ensuperobject(20,19,1,"Better is the poor that walketh in his integrity, than he that is perverse in his lips, and is a fool."));
ensuperobject.biblemap.put("b20_19_2", new ensuperobject(20,19,2,"Also, that the soul be without knowledge, it is not good; and he that hasteth with his feet sinneth."));
ensuperobject.biblemap.put("b20_19_3", new ensuperobject(20,19,3,"The foolishness of man perverteth his way: and his heart fretteth against the LORD."));
ensuperobject.biblemap.put("b20_19_4", new ensuperobject(20,19,4,"Wealth maketh many friends; but the poor is separated from his neighbour."));
ensuperobject.biblemap.put("b20_19_5", new ensuperobject(20,19,5,"A false witness shall not be unpunished, and he that speaketh lies shall not escape."));
ensuperobject.biblemap.put("b20_19_6", new ensuperobject(20,19,6,"Many will intreat the favour of the prince: and every man is a friend to him that giveth gifts."));
ensuperobject.biblemap.put("b20_19_7", new ensuperobject(20,19,7,"All the brethren of the poor do hate him: how much more do his friends go far from him? he pursueth them with words, yet they are wanting to him."));
ensuperobject.biblemap.put("b20_19_8", new ensuperobject(20,19,8,"He that getteth wisdom loveth his own soul: he that keepeth understanding shall find good."));
ensuperobject.biblemap.put("b20_19_9", new ensuperobject(20,19,9,"A false witness shall not be unpunished, and he that speaketh lies shall perish."));
ensuperobject.biblemap.put("b20_19_10", new ensuperobject(20,19,10,"Delight is not seemly for a fool; much less for a servant to have rule over princes."));
ensuperobject.biblemap.put("b20_19_11", new ensuperobject(20,19,11,"The discretion of a man deferreth his anger; and it is his glory to pass over a transgression."));
ensuperobject.biblemap.put("b20_19_12", new ensuperobject(20,19,12,"The king's wrath is as the roaring of a lion; but his favour is as dew upon the grass."));
ensuperobject.biblemap.put("b20_19_13", new ensuperobject(20,19,13,"A foolish son is the calamity of his father: and the contentions of a wife are a continual dropping."));
ensuperobject.biblemap.put("b20_19_14", new ensuperobject(20,19,14,"House and riches are the inheritance of fathers: and a prudent wife is from the LORD."));
ensuperobject.biblemap.put("b20_19_15", new ensuperobject(20,19,15,"Slothfulness casteth into a deep sleep; and an idle soul shall suffer hunger."));
ensuperobject.biblemap.put("b20_19_16", new ensuperobject(20,19,16,"He that keepeth the commandment keepeth his own soul; but he that despiseth his ways shall die."));
ensuperobject.biblemap.put("b20_19_17", new ensuperobject(20,19,17,"He that hath pity upon the poor lendeth unto the LORD; and that which he hath given will he pay him again."));
ensuperobject.biblemap.put("b20_19_18", new ensuperobject(20,19,18,"Chasten thy son while there is hope, and let not thy soul spare for his crying."));
ensuperobject.biblemap.put("b20_19_19", new ensuperobject(20,19,19,"A man of great wrath shall suffer punishment: for if thou deliver him, yet thou must do it again."));
ensuperobject.biblemap.put("b20_19_20", new ensuperobject(20,19,20,"Hear counsel, and receive instruction, that thou mayest be wise in thy latter end."));
ensuperobject.biblemap.put("b20_19_21", new ensuperobject(20,19,21,"There are many devices in a man's heart; nevertheless the counsel of the LORD, that shall stand."));
ensuperobject.biblemap.put("b20_19_22", new ensuperobject(20,19,22,"The desire of a man is his kindness: and a poor man is better than a liar."));
ensuperobject.biblemap.put("b20_19_23", new ensuperobject(20,19,23,"The fear of the LORD tendeth to life: and he that hath it shall abide satisfied; he shall not be visited with evil."));
ensuperobject.biblemap.put("b20_19_24", new ensuperobject(20,19,24,"A slothful man hideth his hand in his bosom, and will not so much as bring it to his mouth again."));
ensuperobject.biblemap.put("b20_19_25", new ensuperobject(20,19,25,"Smite a scorner, and the simple will beware: and reprove one that hath understanding, and he will understand knowledge."));
ensuperobject.biblemap.put("b20_19_26", new ensuperobject(20,19,26,"He that wasteth his father, and chaseth away his mother, is a son that causeth shame, and bringeth reproach."));
ensuperobject.biblemap.put("b20_19_27", new ensuperobject(20,19,27,"Cease, my son, to hear the instruction that causeth to err from the words of knowledge."));
ensuperobject.biblemap.put("b20_19_28", new ensuperobject(20,19,28,"An ungodly witness scorneth judgment: and the mouth of the wicked devoureth iniquity."));
ensuperobject.biblemap.put("b20_19_29", new ensuperobject(20,19,29,"Judgments are prepared for scorners, and stripes for the back of fools."));
ensuperobject.biblemap.put("b20_20_1", new ensuperobject(20,20,1,"Wine is a mocker, strong drink is raging: and whosoever is deceived thereby is not wise."));
ensuperobject.biblemap.put("b20_20_2", new ensuperobject(20,20,2,"The fear of a king is as the roaring of a lion: whoso provoketh him to anger sinneth against his own soul."));
ensuperobject.biblemap.put("b20_20_3", new ensuperobject(20,20,3,"It is an honour for a man to cease from strife: but every fool will be meddling."));
ensuperobject.biblemap.put("b20_20_4", new ensuperobject(20,20,4,"The sluggard will not plow by reason of the cold; therefore shall he beg in harvest, and have nothing."));
ensuperobject.biblemap.put("b20_20_5", new ensuperobject(20,20,5,"Counsel in the heart of man is like deep water; but a man of understanding will draw it out."));
ensuperobject.biblemap.put("b20_20_6", new ensuperobject(20,20,6,"Most men will proclaim every one his own goodness: but a faithful man who can find?"));
ensuperobject.biblemap.put("b20_20_7", new ensuperobject(20,20,7,"The just man walketh in his integrity: his children are blessed after him."));
ensuperobject.biblemap.put("b20_20_8", new ensuperobject(20,20,8,"A king that sitteth in the throne of judgment scattereth away all evil with his eyes."));
ensuperobject.biblemap.put("b20_20_9", new ensuperobject(20,20,9,"Who can say, I have made my heart clean, I am pure from my sin?"));
ensuperobject.biblemap.put("b20_20_10", new ensuperobject(20,20,10,"Divers weights, and divers measures, both of them are alike abomination to the LORD."));
ensuperobject.biblemap.put("b20_20_11", new ensuperobject(20,20,11,"Even a child is known by his doings, whether his work be pure, and whether it be right."));
ensuperobject.biblemap.put("b20_20_12", new ensuperobject(20,20,12,"The hearing ear, and the seeing eye, the LORD hath made even both of them."));
ensuperobject.biblemap.put("b20_20_13", new ensuperobject(20,20,13,"Love not sleep, lest thou come to poverty; open thine eyes, and thou shalt be satisfied with bread."));
ensuperobject.biblemap.put("b20_20_14", new ensuperobject(20,20,14,"It is naught, it is naught, saith the buyer: but when he is gone his way, then he boasteth."));
ensuperobject.biblemap.put("b20_20_15", new ensuperobject(20,20,15,"There is gold, and a multitude of rubies: but the lips of knowledge are a precious jewel."));
ensuperobject.biblemap.put("b20_20_16", new ensuperobject(20,20,16,"Take his garment that is surety for a stranger: and take a pledge of him for a strange woman."));
ensuperobject.biblemap.put("b20_20_17", new ensuperobject(20,20,17,"Bread of deceit is sweet to a man; but afterwards his mouth shall be filled with gravel."));
ensuperobject.biblemap.put("b20_20_18", new ensuperobject(20,20,18,"Every purpose is established by counsel: and with good advice make war."));
ensuperobject.biblemap.put("b20_20_19", new ensuperobject(20,20,19,"He that goeth about as a talebearer revealeth secrets: therefore meddle not with him that flattereth with his lips."));
ensuperobject.biblemap.put("b20_20_20", new ensuperobject(20,20,20,"Whoso curseth his father or his mother, his lamp shall be put out in obscure darkness."));
ensuperobject.biblemap.put("b20_20_21", new ensuperobject(20,20,21,"An inheritance may be gotten hastily at the beginning; but the end thereof shall not be blessed."));
ensuperobject.biblemap.put("b20_20_22", new ensuperobject(20,20,22,"Say not thou, I will recompense evil; but wait on the LORD, and he shall save thee."));
ensuperobject.biblemap.put("b20_20_23", new ensuperobject(20,20,23,"Divers weights are an abomination unto the LORD; and a false balance is not good."));
ensuperobject.biblemap.put("b20_20_24", new ensuperobject(20,20,24,"Man's goings are of the LORD; how can a man then understand his own way?"));
ensuperobject.biblemap.put("b20_20_25", new ensuperobject(20,20,25,"It is a snare to the man who devoureth that which is holy, and after vows to make enquiry."));
ensuperobject.biblemap.put("b20_20_26", new ensuperobject(20,20,26,"A wise king scattereth the wicked, and bringeth the wheel over them."));
ensuperobject.biblemap.put("b20_20_27", new ensuperobject(20,20,27,"The spirit of man is the candle of the LORD, searching all the inward parts of the belly."));
ensuperobject.biblemap.put("b20_20_28", new ensuperobject(20,20,28,"Mercy and truth preserve the king: and his throne is upholden by mercy."));
ensuperobject.biblemap.put("b20_20_29", new ensuperobject(20,20,29,"The glory of young men is their strength: and the beauty of old men is the grey head."));
ensuperobject.biblemap.put("b20_20_30", new ensuperobject(20,20,30,"The blueness of a wound cleanseth away evil: so do stripes the inward parts of the belly."));
ensuperobject.biblemap.put("b20_21_1", new ensuperobject(20,21,1,"The king's heart is in the hand of the LORD, as the rivers of water: he turneth it whithersoever he will."));
ensuperobject.biblemap.put("b20_21_2", new ensuperobject(20,21,2,"Every way of a man is right in his own eyes: but the LORD pondereth the hearts."));
ensuperobject.biblemap.put("b20_21_3", new ensuperobject(20,21,3,"To do justice and judgment is more acceptable to the LORD than sacrifice."));
ensuperobject.biblemap.put("b20_21_4", new ensuperobject(20,21,4,"An high look, and a proud heart, and the plowing of the wicked, is sin."));
ensuperobject.biblemap.put("b20_21_5", new ensuperobject(20,21,5,"The thoughts of the diligent tend only to plenteousness; but of every one that is hasty only to want."));
ensuperobject.biblemap.put("b20_21_6", new ensuperobject(20,21,6,"The getting of treasures by a lying tongue is a vanity tossed to and fro of them that seek death."));
ensuperobject.biblemap.put("b20_21_7", new ensuperobject(20,21,7,"The robbery of the wicked shall destroy them; because they refuse to do judgment."));
ensuperobject.biblemap.put("b20_21_8", new ensuperobject(20,21,8,"The way of man is froward and strange: but as for the pure, his work is right."));
ensuperobject.biblemap.put("b20_21_9", new ensuperobject(20,21,9,"It is better to dwell in a corner of the housetop, than with a brawling woman in a wide house."));
ensuperobject.biblemap.put("b20_21_10", new ensuperobject(20,21,10,"The soul of the wicked desireth evil: his neighbour findeth no favour in his eyes."));
ensuperobject.biblemap.put("b20_21_11", new ensuperobject(20,21,11,"When the scorner is punished, the simple is made wise: and when the wise is instructed, he receiveth knowledge."));
ensuperobject.biblemap.put("b20_21_12", new ensuperobject(20,21,12,"The righteous man wisely considereth the house of the wicked: but God overthroweth the wicked for their wickedness."));
ensuperobject.biblemap.put("b20_21_13", new ensuperobject(20,21,13,"Whoso stoppeth his ears at the cry of the poor, he also shall cry himself, but shall not be heard."));
ensuperobject.biblemap.put("b20_21_14", new ensuperobject(20,21,14,"A gift in secret pacifieth anger: and a reward in the bosom strong wrath."));
ensuperobject.biblemap.put("b20_21_15", new ensuperobject(20,21,15,"It is joy to the just to do judgment: but destruction shall be to the workers of iniquity."));
ensuperobject.biblemap.put("b20_21_16", new ensuperobject(20,21,16,"The man that wandereth out of the way of understanding shall remain in the congregation of the dead."));
ensuperobject.biblemap.put("b20_21_17", new ensuperobject(20,21,17,"He that loveth pleasure shall be a poor man: he that loveth wine and oil shall not be rich."));
ensuperobject.biblemap.put("b20_21_18", new ensuperobject(20,21,18,"The wicked shall be a ransom for the righteous, and the transgressor for the upright."));
ensuperobject.biblemap.put("b20_21_19", new ensuperobject(20,21,19,"It is better to dwell in the wilderness, than with a contentious and an angry woman."));
ensuperobject.biblemap.put("b20_21_20", new ensuperobject(20,21,20,"There is treasure to be desired and oil in the dwelling of the wise; but a foolish man spendeth it up."));
ensuperobject.biblemap.put("b20_21_21", new ensuperobject(20,21,21,"He that followeth after righteousness and mercy findeth life, righteousness, and honour."));
ensuperobject.biblemap.put("b20_21_22", new ensuperobject(20,21,22,"A wise man scaleth the city of the mighty, and casteth down the strength of the confidence thereof."));
ensuperobject.biblemap.put("b20_21_23", new ensuperobject(20,21,23,"Whoso keepeth his mouth and his tongue keepeth his soul from troubles."));
ensuperobject.biblemap.put("b20_21_24", new ensuperobject(20,21,24,"Proud and haughty scorner is his name, who dealeth in proud wrath."));
ensuperobject.biblemap.put("b20_21_25", new ensuperobject(20,21,25,"The desire of the slothful killeth him; for his hands refuse to labour."));
ensuperobject.biblemap.put("b20_21_26", new ensuperobject(20,21,26,"He coveteth greedily all the day long: but the righteous giveth and spareth not."));
ensuperobject.biblemap.put("b20_21_27", new ensuperobject(20,21,27,"The sacrifice of the wicked is abomination: how much more, when he bringeth it with a wicked mind?"));
ensuperobject.biblemap.put("b20_21_28", new ensuperobject(20,21,28,"A false witness shall perish: but the man that heareth speaketh constantly."));
ensuperobject.biblemap.put("b20_21_29", new ensuperobject(20,21,29,"A wicked man hardeneth his face: but as for the upright, he directeth his way."));
ensuperobject.biblemap.put("b20_21_30", new ensuperobject(20,21,30,"There is no wisdom nor understanding nor counsel against the LORD."));
ensuperobject.biblemap.put("b20_21_31", new ensuperobject(20,21,31,"The horse is prepared against the day of battle: but safety is of the LORD."));
ensuperobject.biblemap.put("b20_22_1", new ensuperobject(20,22,1,"A GOOD name is rather to be chosen than great riches, and loving favour rather than silver and gold."));
ensuperobject.biblemap.put("b20_22_2", new ensuperobject(20,22,2,"The rich and poor meet together: the LORD is the maker of them all."));
ensuperobject.biblemap.put("b20_22_3", new ensuperobject(20,22,3,"A prudent man foreseeth the evil, and hideth himself: but the simple pass on, and are punished."));
ensuperobject.biblemap.put("b20_22_4", new ensuperobject(20,22,4,"By humility and the fear of the LORD are riches, and honour, and life."));
ensuperobject.biblemap.put("b20_22_5", new ensuperobject(20,22,5,"Thorns and snares are in the way of the froward: he that doth keep his soul shall be far from them."));
ensuperobject.biblemap.put("b20_22_6", new ensuperobject(20,22,6,"Train up a child in the way he should go: and when he is old, he will not depart from it."));
ensuperobject.biblemap.put("b20_22_7", new ensuperobject(20,22,7,"The rich ruleth over the poor, and the borrower is servant to the lender."));
ensuperobject.biblemap.put("b20_22_8", new ensuperobject(20,22,8,"He that soweth iniquity shall reap vanity: and the rod of his anger shall fail."));
ensuperobject.biblemap.put("b20_22_9", new ensuperobject(20,22,9,"He that hath a bountiful eye shall be blessed; for he giveth of his bread to the poor."));
ensuperobject.biblemap.put("b20_22_10", new ensuperobject(20,22,10,"Cast out the scorner, and contention shall go out; yea, strife and reproach shall cease."));
ensuperobject.biblemap.put("b20_22_11", new ensuperobject(20,22,11,"He that loveth pureness of heart, for the grace of his lips the king shall be his friend."));
ensuperobject.biblemap.put("b20_22_12", new ensuperobject(20,22,12,"The eyes of the LORD preserve knowledge, and he overthroweth the words of the transgressor."));
ensuperobject.biblemap.put("b20_22_13", new ensuperobject(20,22,13,"The slothful man saith, There is a lion without, I shall be slain in the streets."));
ensuperobject.biblemap.put("b20_22_14", new ensuperobject(20,22,14,"The mouth of strange women is a deep pit: he that is abhorred of the LORD shall fall therein."));
ensuperobject.biblemap.put("b20_22_15", new ensuperobject(20,22,15,"Foolishness is bound in the heart of a child; but the rod of correction shall drive it far from him."));
ensuperobject.biblemap.put("b20_22_16", new ensuperobject(20,22,16,"He that oppresseth the poor to increase his riches, and he that giveth to the rich, shall surely come to want."));
ensuperobject.biblemap.put("b20_22_17", new ensuperobject(20,22,17,"Bow down thine ear, and hear the words of the wise, and apply thine heart unto my knowledge."));
ensuperobject.biblemap.put("b20_22_18", new ensuperobject(20,22,18,"For it is a pleasant thing if thou keep them within thee; they shall withal be fitted in thy lips."));
ensuperobject.biblemap.put("b20_22_19", new ensuperobject(20,22,19,"That thy trust may be in the LORD, I have made known to thee this day, even to thee."));
ensuperobject.biblemap.put("b20_22_20", new ensuperobject(20,22,20,"Have not I written to thee excellent things in counsels and knowledge,"));
ensuperobject.biblemap.put("b20_22_21", new ensuperobject(20,22,21,"That I might make thee know the certainty of the words of truth; that thou mightest answer the words of truth to them that send unto thee?"));
ensuperobject.biblemap.put("b20_22_22", new ensuperobject(20,22,22,"Rob not the poor, because he is poor: neither oppress the afflicted in the gate:"));
ensuperobject.biblemap.put("b20_22_23", new ensuperobject(20,22,23,"For the LORD will plead their cause, and spoil the soul of those that spoiled them."));
ensuperobject.biblemap.put("b20_22_24", new ensuperobject(20,22,24,"Make no friendship with an angry man; and with a furious man thou shalt not go:"));
ensuperobject.biblemap.put("b20_22_25", new ensuperobject(20,22,25,"Lest thou learn his ways, and get a snare to thy soul."));
ensuperobject.biblemap.put("b20_22_26", new ensuperobject(20,22,26,"Be not thou one of them that strike hands, or of them that are sureties for debts."));
ensuperobject.biblemap.put("b20_22_27", new ensuperobject(20,22,27,"If thou hast nothing to pay, why should he take away thy bed from under thee?"));
ensuperobject.biblemap.put("b20_22_28", new ensuperobject(20,22,28,"Remove not the ancient landmark, which thy fathers have set."));
ensuperobject.biblemap.put("b20_22_29", new ensuperobject(20,22,29,"Seest thou a man diligent in his business? he shall stand before kings; he shall not stand before mean men."));
ensuperobject.biblemap.put("b20_23_1", new ensuperobject(20,23,1,"When thou sittest to eat with a ruler, consider diligently what is before thee:"));
ensuperobject.biblemap.put("b20_23_2", new ensuperobject(20,23,2,"And put a knife to thy throat, if thou be a man given to appetite."));
ensuperobject.biblemap.put("b20_23_3", new ensuperobject(20,23,3,"Be not desirous of his dainties: for they are deceitful meat."));
ensuperobject.biblemap.put("b20_23_4", new ensuperobject(20,23,4,"Labour not to be rich: cease from thine own wisdom."));
ensuperobject.biblemap.put("b20_23_5", new ensuperobject(20,23,5,"Wilt thou set thine eyes upon that which is not? for riches certainly make themselves wings; they fly away as an eagle toward heaven."));
ensuperobject.biblemap.put("b20_23_6", new ensuperobject(20,23,6,"Eat thou not the bread of him that hath an evil eye, neither desire thou his dainty meats:"));
ensuperobject.biblemap.put("b20_23_7", new ensuperobject(20,23,7,"For as he thinketh in his heart, so is he: Eat and drink, saith he to thee; but his heart is not with thee."));
ensuperobject.biblemap.put("b20_23_8", new ensuperobject(20,23,8,"The morsel which thou hast eaten shalt thou vomit up, and lose thy sweet words."));
ensuperobject.biblemap.put("b20_23_9", new ensuperobject(20,23,9,"Speak not in the ears of a fool: for he will despise the wisdom of thy words."));
ensuperobject.biblemap.put("b20_23_10", new ensuperobject(20,23,10,"Remove not the old landmark; and enter not into the fields of the fatherless:"));
ensuperobject.biblemap.put("b20_23_11", new ensuperobject(20,23,11,"For their redeemer is mighty; he shall plead their cause with thee."));
ensuperobject.biblemap.put("b20_23_12", new ensuperobject(20,23,12,"Apply thine heart unto instruction, and thine ears to the words of knowledge."));
ensuperobject.biblemap.put("b20_23_13", new ensuperobject(20,23,13,"Withhold not correction from the child: for if thou beatest him with the rod, he shall not die."));
ensuperobject.biblemap.put("b20_23_14", new ensuperobject(20,23,14,"Thou shalt beat him with the rod, and shalt deliver his soul from hell."));
ensuperobject.biblemap.put("b20_23_15", new ensuperobject(20,23,15,"My son, if thine heart be wise, my heart shall rejoice, even mine."));
ensuperobject.biblemap.put("b20_23_16", new ensuperobject(20,23,16,"Yea, my reins shall rejoice, when thy lips speak right things."));
ensuperobject.biblemap.put("b20_23_17", new ensuperobject(20,23,17,"Let not thine heart envy sinners: but be thou in the fear of the LORD all the day long."));
ensuperobject.biblemap.put("b20_23_18", new ensuperobject(20,23,18,"For surely there is an end; and thine expectation shall not be cut off."));
ensuperobject.biblemap.put("b20_23_19", new ensuperobject(20,23,19,"Hear thou, my son, and be wise, and guide thine heart in the way."));
ensuperobject.biblemap.put("b20_23_20", new ensuperobject(20,23,20,"Be not among winebibbers; among riotous eaters of flesh:"));
ensuperobject.biblemap.put("b20_23_21", new ensuperobject(20,23,21,"For the drunkard and the glutton shall come to poverty: and drowsiness shall clothe a man with rags."));
ensuperobject.biblemap.put("b20_23_22", new ensuperobject(20,23,22,"Hearken unto thy father that begat thee, and despise not thy mother when she is old."));
ensuperobject.biblemap.put("b20_23_23", new ensuperobject(20,23,23,"Buy the truth, and sell it not; also wisdom, and instruction, and understanding."));
ensuperobject.biblemap.put("b20_23_24", new ensuperobject(20,23,24,"The father of the righteous shall greatly rejoice: and he that begetteth a wise child shall have joy of him."));
ensuperobject.biblemap.put("b20_23_25", new ensuperobject(20,23,25,"Thy father and thy mother shall be glad, and she that bare thee shall rejoice."));
ensuperobject.biblemap.put("b20_23_26", new ensuperobject(20,23,26,"My son, give me thine heart, and let thine eyes observe my ways."));
ensuperobject.biblemap.put("b20_23_27", new ensuperobject(20,23,27,"For a whore is a deep ditch; and a strange woman is a narrow pit."));
ensuperobject.biblemap.put("b20_23_28", new ensuperobject(20,23,28,"She also lieth in wait as for a prey, and increaseth the transgressors among men."));
ensuperobject.biblemap.put("b20_23_29", new ensuperobject(20,23,29,"Who hath woe? who hath sorrow? who hath contentions? who hath babbling? who hath wounds without cause? who hath redness of eyes?"));
ensuperobject.biblemap.put("b20_23_30", new ensuperobject(20,23,30,"They that tarry long at the wine; they that go to seek mixed wine."));
ensuperobject.biblemap.put("b20_23_31", new ensuperobject(20,23,31,"Look not thou upon the wine when it is red, when it giveth his colour in the cup, when it moveth itself aright."));
ensuperobject.biblemap.put("b20_23_32", new ensuperobject(20,23,32,"At the last it biteth like a serpent, and stingeth like an adder."));
ensuperobject.biblemap.put("b20_23_33", new ensuperobject(20,23,33,"Thine eyes shall behold strange women, and thine heart shall utter perverse things."));
ensuperobject.biblemap.put("b20_23_34", new ensuperobject(20,23,34,"Yea, thou shalt be as he that lieth down in the midst of the sea, or as he that lieth upon the top of a mast."));
ensuperobject.biblemap.put("b20_23_35", new ensuperobject(20,23,35,"They have stricken me, shalt thou say, and I was not sick; they have beaten me, and I felt it not: when shall I awake? I will seek it yet again."));
ensuperobject.biblemap.put("b20_24_1", new ensuperobject(20,24,1,"Be not thou envious against evil men, neither desire to be with them."));
ensuperobject.biblemap.put("b20_24_2", new ensuperobject(20,24,2,"For their heart studieth destruction, and their lips talk of mischief."));
ensuperobject.biblemap.put("b20_24_3", new ensuperobject(20,24,3,"Through wisdom is an house builded; and by understanding it is established:"));
ensuperobject.biblemap.put("b20_24_4", new ensuperobject(20,24,4,"And by knowledge shall the chambers be filled with all precious and pleasant riches."));
ensuperobject.biblemap.put("b20_24_5", new ensuperobject(20,24,5,"A wise man is strong; yea, a man of knowledge increaseth strength."));
ensuperobject.biblemap.put("b20_24_6", new ensuperobject(20,24,6,"For by wise counsel thou shalt make thy war: and in multitude of counsellors there is safety."));
ensuperobject.biblemap.put("b20_24_7", new ensuperobject(20,24,7,"Wisdom is too high for a fool: he openeth not his mouth in the gate."));
ensuperobject.biblemap.put("b20_24_8", new ensuperobject(20,24,8,"He that deviseth to do evil shall be called a mischievous person."));
ensuperobject.biblemap.put("b20_24_9", new ensuperobject(20,24,9,"The thought of foolishness is sin: and the scorner is an abomination to men."));
ensuperobject.biblemap.put("b20_24_10", new ensuperobject(20,24,10,"If thou faint in the day of adversity, thy strength is small."));
ensuperobject.biblemap.put("b20_24_11", new ensuperobject(20,24,11,"If thou forbear to deliver them that are drawn unto death, and those that are ready to be slain;"));
ensuperobject.biblemap.put("b20_24_12", new ensuperobject(20,24,12,"If thou sayest, Behold, we knew it not; doth not he that pondereth the heart consider it? and he that keepeth thy soul, doth not he know it? and shall not he render to every man according to his works?"));
ensuperobject.biblemap.put("b20_24_13", new ensuperobject(20,24,13,"My son, eat thou honey, because it is good; and the honeycomb, which is sweet to thy taste:"));
ensuperobject.biblemap.put("b20_24_14", new ensuperobject(20,24,14,"So shall the knowledge of wisdom be unto thy soul: when thou hast found it, then there shall be a reward, and thy expectation shall not be cut off."));
ensuperobject.biblemap.put("b20_24_15", new ensuperobject(20,24,15,"Lay not wait, O wicked man, against the dwelling of the righteous; spoil not his resting place:"));
ensuperobject.biblemap.put("b20_24_16", new ensuperobject(20,24,16,"For a just man falleth seven times, and riseth up again: but the wicked shall fall into mischief."));
ensuperobject.biblemap.put("b20_24_17", new ensuperobject(20,24,17,"Rejoice not when thine enemy falleth, and let not thine heart be glad when he stumbleth:"));
ensuperobject.biblemap.put("b20_24_18", new ensuperobject(20,24,18,"Lest the LORD see it, and it displease him, and he turn away his wrath from him."));
ensuperobject.biblemap.put("b20_24_19", new ensuperobject(20,24,19,"Fret not thyself because of evil men, neither be thou envious at the wicked;"));
ensuperobject.biblemap.put("b20_24_20", new ensuperobject(20,24,20,"For there shall be no reward to the evil man; the candle of the wicked shall be put out."));
ensuperobject.biblemap.put("b20_24_21", new ensuperobject(20,24,21,"My son, fear thou the LORD and the king: and meddle not with them that are given to change:"));
ensuperobject.biblemap.put("b20_24_22", new ensuperobject(20,24,22,"For their calamity shall rise suddenly; and who knoweth the ruin of them both?"));
ensuperobject.biblemap.put("b20_24_23", new ensuperobject(20,24,23,"These things also belong to the wise. It is not good to have respect of persons in judgment."));
ensuperobject.biblemap.put("b20_24_24", new ensuperobject(20,24,24,"He that saith unto the wicked, Thou art righteous; him shall the people curse, nations shall abhor him:"));
ensuperobject.biblemap.put("b20_24_25", new ensuperobject(20,24,25,"But to them that rebuke him shall be delight, and a good blessing shall come upon them."));
ensuperobject.biblemap.put("b20_24_26", new ensuperobject(20,24,26,"Every man shall kiss his lips that giveth a right answer."));
ensuperobject.biblemap.put("b20_24_27", new ensuperobject(20,24,27,"Prepare thy work without, and make it fit for thyself in the field; and afterwards build thine house."));
ensuperobject.biblemap.put("b20_24_28", new ensuperobject(20,24,28,"Be not a witness against thy neighbour without cause; and deceive not with thy lips."));
ensuperobject.biblemap.put("b20_24_29", new ensuperobject(20,24,29,"Say not, I will do so to him as he hath done to me: I will render to the man according to his work."));
ensuperobject.biblemap.put("b20_24_30", new ensuperobject(20,24,30,"I went by the field of the slothful, and by the vineyard of the man void of understanding;"));
ensuperobject.biblemap.put("b20_24_31", new ensuperobject(20,24,31,"And, lo, it was all grown over with thorns, and nettles had covered the face thereof, and the stone wall thereof was broken down."));
ensuperobject.biblemap.put("b20_24_32", new ensuperobject(20,24,32,"Then I saw, and considered it well: I looked upon it, and received instruction."));
ensuperobject.biblemap.put("b20_24_33", new ensuperobject(20,24,33,"Yet a little sleep, a little slumber, a little folding of the hands to sleep:"));
ensuperobject.biblemap.put("b20_24_34", new ensuperobject(20,24,34,"So shall thy poverty come as one that travelleth; and thy want as an armed man."));
ensuperobject.biblemap.put("b20_25_1", new ensuperobject(20,25,1,"These are also proverbs of Solomon, which the men of Hezekiah king of Judah copied out."));
ensuperobject.biblemap.put("b20_25_2", new ensuperobject(20,25,2,"It is the glory of God to conceal a thing: but the honour of kings is to search out a matter."));
ensuperobject.biblemap.put("b20_25_3", new ensuperobject(20,25,3,"The heaven for height, and the earth for depth, and the heart of kings is unsearchable."));
ensuperobject.biblemap.put("b20_25_4", new ensuperobject(20,25,4,"Take away the dross from the silver, and there shall come forth a vessel for the finer."));
ensuperobject.biblemap.put("b20_25_5", new ensuperobject(20,25,5,"Take away the wicked from before the king, and his throne shall be established in righteousness."));
ensuperobject.biblemap.put("b20_25_6", new ensuperobject(20,25,6,"Put not forth thyself in the presence of the king, and stand not in the place of great men:"));
ensuperobject.biblemap.put("b20_25_7", new ensuperobject(20,25,7,"For better it is that it be said unto thee, Come up hither; than that thou shouldest be put lower in the presence of the prince whom thine eyes have seen."));
ensuperobject.biblemap.put("b20_25_8", new ensuperobject(20,25,8,"Go not forth hastily to strive, lest thou know not what to do in the end thereof, when thy neighbour hath put thee to shame."));
ensuperobject.biblemap.put("b20_25_9", new ensuperobject(20,25,9,"Debate thy cause with thy neighbour himself; and discover not a secret to another:"));
ensuperobject.biblemap.put("b20_25_10", new ensuperobject(20,25,10,"Lest he that heareth it put thee to shame, and thine infamy turn not away."));
ensuperobject.biblemap.put("b20_25_11", new ensuperobject(20,25,11,"A word fitly spoken is like apples of gold in pictures of silver."));
ensuperobject.biblemap.put("b20_25_12", new ensuperobject(20,25,12,"As an earring of gold, and an ornament of fine gold, so is a wise reprover upon an obedient ear."));
ensuperobject.biblemap.put("b20_25_13", new ensuperobject(20,25,13,"As the cold of snow in the time of harvest, so is a faithful messenger to them that send him: for he refresheth the soul of his masters."));
ensuperobject.biblemap.put("b20_25_14", new ensuperobject(20,25,14,"Whoso boasteth himself of a false gift is like clouds and wind without rain."));
ensuperobject.biblemap.put("b20_25_15", new ensuperobject(20,25,15,"By long forbearing is a prince persuaded, and a soft tongue breaketh the bone."));
ensuperobject.biblemap.put("b20_25_16", new ensuperobject(20,25,16,"Hast thou found honey? eat so much as is sufficient for thee, lest thou be filled therewith, and vomit it."));
ensuperobject.biblemap.put("b20_25_17", new ensuperobject(20,25,17,"Withdraw thy foot from thy neighbour's house; lest he be weary of thee, and so hate thee."));
ensuperobject.biblemap.put("b20_25_18", new ensuperobject(20,25,18,"A man that beareth false witness against his neighbour is a maul, and a sword, and a sharp arrow."));
ensuperobject.biblemap.put("b20_25_19", new ensuperobject(20,25,19,"Confidence in an unfaithful man in time of trouble is like a broken tooth, and a foot out of joint."));
ensuperobject.biblemap.put("b20_25_20", new ensuperobject(20,25,20,"As he that taketh away a garment in cold weather, and as vinegar upon nitre, so is he that singeth songs to an heavy heart."));
ensuperobject.biblemap.put("b20_25_21", new ensuperobject(20,25,21,"If thine enemy be hungry, give him bread to eat; and if he be thirsty, give him water to drink:"));
ensuperobject.biblemap.put("b20_25_22", new ensuperobject(20,25,22,"For thou shalt heap coals of fire upon his head, and the LORD shall reward thee."));
ensuperobject.biblemap.put("b20_25_23", new ensuperobject(20,25,23,"The north wind driveth away rain: so doth an angry countenance a backbiting tongue."));
ensuperobject.biblemap.put("b20_25_24", new ensuperobject(20,25,24,"It is better to dwell in the corner of the housetop, than with a brawling woman and in a wide house."));
ensuperobject.biblemap.put("b20_25_25", new ensuperobject(20,25,25,"As cold waters to a thirsty soul, so is good news from a far country."));
ensuperobject.biblemap.put("b20_25_26", new ensuperobject(20,25,26,"A righteous man falling down before the wicked is as a troubled fountain, and a corrupt spring."));
ensuperobject.biblemap.put("b20_25_27", new ensuperobject(20,25,27,"It is not good to eat much honey: so for men to search their own glory is not glory."));
ensuperobject.biblemap.put("b20_25_28", new ensuperobject(20,25,28,"He that hath no rule over his own spirit is like a city that is broken down, and without walls."));
ensuperobject.biblemap.put("b20_26_1", new ensuperobject(20,26,1,"As snow in summer, and as rain in harvest, so honour is not seemly for a fool."));
ensuperobject.biblemap.put("b20_26_2", new ensuperobject(20,26,2,"As the bird by wandering, as the swallow by flying, so the curse causeless shall not come."));
ensuperobject.biblemap.put("b20_26_3", new ensuperobject(20,26,3,"A whip for the horse, a bridle for the ass, and a rod for the fool's back."));
ensuperobject.biblemap.put("b20_26_4", new ensuperobject(20,26,4,"Answer not a fool according to his folly, lest thou also be like unto him."));
ensuperobject.biblemap.put("b20_26_5", new ensuperobject(20,26,5,"Answer a fool according to his folly, lest he be wise in his own conceit."));
ensuperobject.biblemap.put("b20_26_6", new ensuperobject(20,26,6,"He that sendeth a message by the hand of a fool cutteth off the feet, and drinketh damage."));
ensuperobject.biblemap.put("b20_26_7", new ensuperobject(20,26,7,"The legs of the lame are not equal: so is a parable in the mouth of fools."));
ensuperobject.biblemap.put("b20_26_8", new ensuperobject(20,26,8,"As he that bindeth a stone in a sling, so is he that giveth honour to a fool."));
ensuperobject.biblemap.put("b20_26_9", new ensuperobject(20,26,9,"As a thorn goeth up into the hand of a drunkard, so is a parable in the mouth of fools."));
ensuperobject.biblemap.put("b20_26_10", new ensuperobject(20,26,10,"The great God that formed all things both rewardeth the fool, and rewardeth transgressors."));
ensuperobject.biblemap.put("b20_26_11", new ensuperobject(20,26,11,"As a dog returneth to his vomit, so a fool returneth to his folly."));
ensuperobject.biblemap.put("b20_26_12", new ensuperobject(20,26,12,"Seest thou a man wise in his own conceit? there is more hope of a fool than of him."));
ensuperobject.biblemap.put("b20_26_13", new ensuperobject(20,26,13,"The slothful man saith, There is a lion in the way; a lion is in the streets."));
ensuperobject.biblemap.put("b20_26_14", new ensuperobject(20,26,14,"As the door turneth upon his hinges, so doth the slothful upon his bed."));
ensuperobject.biblemap.put("b20_26_15", new ensuperobject(20,26,15,"The slothful hideth his hand in his bosom; it grieveth him to bring it again to his mouth."));
ensuperobject.biblemap.put("b20_26_16", new ensuperobject(20,26,16,"The sluggard is wiser in his own conceit than seven men that can render a reason."));
ensuperobject.biblemap.put("b20_26_17", new ensuperobject(20,26,17,"He that passeth by, and meddleth with strife belonging not to him, is like one that taketh a dog by the ears."));
ensuperobject.biblemap.put("b20_26_18", new ensuperobject(20,26,18,"As a mad man who casteth firebrands, arrows, and death,"));
ensuperobject.biblemap.put("b20_26_19", new ensuperobject(20,26,19,"So is the man that deceiveth his neighbour, and saith, Am not I in sport?"));
ensuperobject.biblemap.put("b20_26_20", new ensuperobject(20,26,20,"Where no wood is, there the fire goeth out: so where there is no talebearer, the strife ceaseth."));
ensuperobject.biblemap.put("b20_26_21", new ensuperobject(20,26,21,"As coals are to burning coals, and wood to fire; so is a contentious man to kindle strife."));
ensuperobject.biblemap.put("b20_26_22", new ensuperobject(20,26,22,"The words of a talebearer are as wounds, and they go down into the innermost parts of the belly."));
ensuperobject.biblemap.put("b20_26_23", new ensuperobject(20,26,23,"Burning lips and a wicked heart are like a potsherd covered with silver dross."));
ensuperobject.biblemap.put("b20_26_24", new ensuperobject(20,26,24,"He that hateth dissembleth with his lips, and layeth up deceit within him;"));
ensuperobject.biblemap.put("b20_26_25", new ensuperobject(20,26,25,"When he speaketh fair, believe him not: for there are seven abominations in his heart."));
ensuperobject.biblemap.put("b20_26_26", new ensuperobject(20,26,26,"Whose hatred is covered by deceit, his wickedness shall be shewed before the whole congregation."));
ensuperobject.biblemap.put("b20_26_27", new ensuperobject(20,26,27,"Whoso diggeth a pit shall fall therein: and he that rolleth a stone, it will return upon him."));
ensuperobject.biblemap.put("b20_26_28", new ensuperobject(20,26,28,"A lying tongue hateth those that are afflicted by it; and a flattering mouth worketh ruin."));
ensuperobject.biblemap.put("b20_27_1", new ensuperobject(20,27,1,"Boast not thyself of to morrow; for thou knowest not what a day may bring forth."));
ensuperobject.biblemap.put("b20_27_2", new ensuperobject(20,27,2,"Let another man praise thee, and not thine own mouth; a stranger, and not thine own lips."));
ensuperobject.biblemap.put("b20_27_3", new ensuperobject(20,27,3,"A stone is heavy, and the sand weighty; but a fool's wrath is heavier than them both."));
ensuperobject.biblemap.put("b20_27_4", new ensuperobject(20,27,4,"Wrath is cruel, and anger is outrageous; but who is able to stand before envy?"));
ensuperobject.biblemap.put("b20_27_5", new ensuperobject(20,27,5,"Open rebuke is better than secret love."));
ensuperobject.biblemap.put("b20_27_6", new ensuperobject(20,27,6,"Faithful are the wounds of a friend; but the kisses of an enemy are deceitful."));
ensuperobject.biblemap.put("b20_27_7", new ensuperobject(20,27,7,"The full soul loatheth an honeycomb; but to the hungry soul every bitter thing is sweet."));
ensuperobject.biblemap.put("b20_27_8", new ensuperobject(20,27,8,"As a bird that wandereth from her nest, so is a man that wandereth from his place."));
ensuperobject.biblemap.put("b20_27_9", new ensuperobject(20,27,9,"Ointment and perfume rejoice the heart: so doth the sweetness of a man's friend by hearty counsel."));
ensuperobject.biblemap.put("b20_27_10", new ensuperobject(20,27,10,"Thine own friend, and thy father's friend, forsake not; neither go into thy brother's house in the day of thy calamity: for better is a neighbour that is near than a brother far off."));
ensuperobject.biblemap.put("b20_27_11", new ensuperobject(20,27,11,"My son, be wise, and make my heart glad, that I may answer him that reproacheth me."));
ensuperobject.biblemap.put("b20_27_12", new ensuperobject(20,27,12,"A prudent man foreseeth the evil, and hideth himself; but the simple pass on, and are punished."));
ensuperobject.biblemap.put("b20_27_13", new ensuperobject(20,27,13,"Take his garment that is surety for a stranger, and take a pledge of him for a strange woman."));
ensuperobject.biblemap.put("b20_27_14", new ensuperobject(20,27,14,"He that blesseth his friend with a loud voice, rising early in the morning, it shall be counted a curse to him."));
ensuperobject.biblemap.put("b20_27_15", new ensuperobject(20,27,15,"A continual dropping in a very rainy day and a contentious woman are alike."));
ensuperobject.biblemap.put("b20_27_16", new ensuperobject(20,27,16,"Whosoever hideth her hideth the wind, and the ointment of his right hand, which bewrayeth itself."));
ensuperobject.biblemap.put("b20_27_17", new ensuperobject(20,27,17,"Iron sharpeneth iron; so a man sharpeneth the countenance of his friend."));
ensuperobject.biblemap.put("b20_27_18", new ensuperobject(20,27,18,"Whoso keepeth the fig tree shall eat the fruit thereof: so he that waiteth on his master shall be honoured."));
ensuperobject.biblemap.put("b20_27_19", new ensuperobject(20,27,19,"As in water face answereth to face, so the heart of man to man."));
ensuperobject.biblemap.put("b20_27_20", new ensuperobject(20,27,20,"Hell and destruction are never full; so the eyes of man are never satisfied."));
ensuperobject.biblemap.put("b20_27_21", new ensuperobject(20,27,21,"As the fining pot for silver, and the furnace for gold; so is a man to his praise."));
ensuperobject.biblemap.put("b20_27_22", new ensuperobject(20,27,22,"Though thou shouldest bray a fool in a mortar among wheat with a pestle, yet will not his foolishness depart from him."));
ensuperobject.biblemap.put("b20_27_23", new ensuperobject(20,27,23,"Be thou diligent to know the state of thy flocks, and look well to thy herds."));
ensuperobject.biblemap.put("b20_27_24", new ensuperobject(20,27,24,"For riches are not for ever: and doth the crown endure to every generation?"));
ensuperobject.biblemap.put("b20_27_25", new ensuperobject(20,27,25,"The hay appeareth, and the tender grass sheweth itself, and herbs of the mountains are gathered."));
ensuperobject.biblemap.put("b20_27_26", new ensuperobject(20,27,26,"The lambs are for thy clothing, and the goats are the price of the field."));
ensuperobject.biblemap.put("b20_27_27", new ensuperobject(20,27,27,"And thou shalt have goats' milk enough for thy food, for the food of thy household, and for the maintenance for thy maidens."));
ensuperobject.biblemap.put("b20_28_1", new ensuperobject(20,28,1,"The wicked flee when no man pursueth: but the righteous are bold as a lion."));
ensuperobject.biblemap.put("b20_28_2", new ensuperobject(20,28,2,"For the transgression of a land many are the princes thereof: but by a man of understanding and knowledge the state thereof shall be prolonged."));
ensuperobject.biblemap.put("b20_28_3", new ensuperobject(20,28,3,"A poor man that oppresseth the poor is like a sweeping rain which leaveth no food."));
ensuperobject.biblemap.put("b20_28_4", new ensuperobject(20,28,4,"They that forsake the law praise the wicked: but such as keep the law contend with them."));
ensuperobject.biblemap.put("b20_28_5", new ensuperobject(20,28,5,"Evil men understand not judgment: but they that seek the LORD understand all things."));
ensuperobject.biblemap.put("b20_28_6", new ensuperobject(20,28,6,"Better is the poor that walketh in his uprightness, than he that is perverse in his ways, though he be rich."));
ensuperobject.biblemap.put("b20_28_7", new ensuperobject(20,28,7,"Whoso keepeth the law is a wise son: but he that is a companion of riotous men shameth his father."));
ensuperobject.biblemap.put("b20_28_8", new ensuperobject(20,28,8,"He that by usury and unjust gain increaseth his substance, he shall gather it for him that will pity the poor."));
ensuperobject.biblemap.put("b20_28_9", new ensuperobject(20,28,9,"He that turneth away his ear from hearing the law, even his prayer shall be abomination."));
ensuperobject.biblemap.put("b20_28_10", new ensuperobject(20,28,10,"Whoso causeth the righteous to go astray in an evil way, he shall fall himself into his own pit: but the upright shall have good things in possession."));
ensuperobject.biblemap.put("b20_28_11", new ensuperobject(20,28,11,"The rich man is wise in his own conceit; but the poor that hath understanding searcheth him out."));
ensuperobject.biblemap.put("b20_28_12", new ensuperobject(20,28,12,"When righteous men do rejoice, there is great glory: but when the wicked rise, a man is hidden."));
ensuperobject.biblemap.put("b20_28_13", new ensuperobject(20,28,13,"He that covereth his sins shall not prosper: but whoso confesseth and forsaketh them shall have mercy."));
ensuperobject.biblemap.put("b20_28_14", new ensuperobject(20,28,14,"Happy is the man that feareth alway: but he that hardeneth his heart shall fall into mischief."));
ensuperobject.biblemap.put("b20_28_15", new ensuperobject(20,28,15,"As a roaring lion, and a ranging bear; so is a wicked ruler over the poor people."));
ensuperobject.biblemap.put("b20_28_16", new ensuperobject(20,28,16,"The prince that wanteth understanding is also a great oppressor: but he that hateth covetousness shall prolong his days."));
ensuperobject.biblemap.put("b20_28_17", new ensuperobject(20,28,17,"A man that doeth violence to the blood of any person shall flee to the pit; let no man stay him."));
ensuperobject.biblemap.put("b20_28_18", new ensuperobject(20,28,18,"Whoso walketh uprightly shall be saved: but he that is perverse in his ways shall fall at once."));
ensuperobject.biblemap.put("b20_28_19", new ensuperobject(20,28,19,"He that tilleth his land shall have plenty of bread: but he that followeth after vain persons shall have poverty enough."));
ensuperobject.biblemap.put("b20_28_20", new ensuperobject(20,28,20,"A faithful man shall abound with blessings: but he that maketh haste to be rich shall not be innocent."));
ensuperobject.biblemap.put("b20_28_21", new ensuperobject(20,28,21,"To have respect of persons is not good: for for a piece of bread that man will transgress."));
ensuperobject.biblemap.put("b20_28_22", new ensuperobject(20,28,22,"He that hasteth to be rich hath an evil eye, and considereth not that poverty shall come upon him."));
ensuperobject.biblemap.put("b20_28_23", new ensuperobject(20,28,23,"He that rebuketh a man afterwards shall find more favour than he that flattereth with the tongue."));
ensuperobject.biblemap.put("b20_28_24", new ensuperobject(20,28,24,"Whoso robbeth his father or his mother, and saith, It is no transgression; the same is the companion of a destroyer."));
ensuperobject.biblemap.put("b20_28_25", new ensuperobject(20,28,25,"He that is of a proud heart stirreth up strife: but he that putteth his trust in the LORD shall be made fat."));
ensuperobject.biblemap.put("b20_28_26", new ensuperobject(20,28,26,"He that trusteth in his own heart is a fool: but whoso walketh wisely, he shall be delivered."));
ensuperobject.biblemap.put("b20_28_27", new ensuperobject(20,28,27,"He that giveth unto the poor shall not lack: but he that hideth his eyes shall have many a curse."));
ensuperobject.biblemap.put("b20_28_28", new ensuperobject(20,28,28,"When the wicked rise, men hide themselves: but when they perish, the righteous increase."));
ensuperobject.biblemap.put("b20_29_1", new ensuperobject(20,29,1,"He, that being often reproved hardeneth his neck, shall suddenly be destroyed, and that without remedy."));
ensuperobject.biblemap.put("b20_29_2", new ensuperobject(20,29,2,"When the righteous are in authority, the people rejoice: but when the wicked beareth rule, the people mourn."));
ensuperobject.biblemap.put("b20_29_3", new ensuperobject(20,29,3,"Whoso loveth wisdom rejoiceth his father: but he that keepeth company with harlots spendeth his substance."));
ensuperobject.biblemap.put("b20_29_4", new ensuperobject(20,29,4,"The king by judgment establisheth the land: but he that receiveth gifts overthroweth it."));
ensuperobject.biblemap.put("b20_29_5", new ensuperobject(20,29,5,"A man that flattereth his neighbour spreadeth a net for his feet."));
ensuperobject.biblemap.put("b20_29_6", new ensuperobject(20,29,6,"In the transgression of an evil man there is a snare: but the righteous doth sing and rejoice."));
ensuperobject.biblemap.put("b20_29_7", new ensuperobject(20,29,7,"The righteous considereth the cause of the poor: but the wicked regardeth not to know it."));
ensuperobject.biblemap.put("b20_29_8", new ensuperobject(20,29,8,"Scornful men bring a city into a snare: but wise men turn away wrath."));
ensuperobject.biblemap.put("b20_29_9", new ensuperobject(20,29,9,"If a wise man contendeth with a foolish man, whether he rage or laugh, there is no rest."));
ensuperobject.biblemap.put("b20_29_10", new ensuperobject(20,29,10,"The bloodthirsty hate the upright: but the just seek his soul."));
ensuperobject.biblemap.put("b20_29_11", new ensuperobject(20,29,11,"A fool uttereth all his mind: but a wise man keepeth it in till afterwards."));
ensuperobject.biblemap.put("b20_29_12", new ensuperobject(20,29,12,"If a ruler hearken to lies, all his servants are wicked."));
ensuperobject.biblemap.put("b20_29_13", new ensuperobject(20,29,13,"The poor and the deceitful man meet together: the LORD lighteneth both their eyes."));
ensuperobject.biblemap.put("b20_29_14", new ensuperobject(20,29,14,"The king that faithfully judgeth the poor, his throne shall be established for ever."));
ensuperobject.biblemap.put("b20_29_15", new ensuperobject(20,29,15,"The rod and reproof give wisdom: but a child left to himself bringeth his mother to shame."));
ensuperobject.biblemap.put("b20_29_16", new ensuperobject(20,29,16,"When the wicked are multiplied, transgression increaseth: but the righteous shall see their fall."));
ensuperobject.biblemap.put("b20_29_17", new ensuperobject(20,29,17,"Correct thy son, and he shall give thee rest; yea, he shall give delight unto thy soul."));
ensuperobject.biblemap.put("b20_29_18", new ensuperobject(20,29,18,"Where there is no vision, the people perish: but he that keepeth the law, happy is he."));
ensuperobject.biblemap.put("b20_29_19", new ensuperobject(20,29,19,"A servant will not be corrected by words: for though he understand he will not answer."));
ensuperobject.biblemap.put("b20_29_20", new ensuperobject(20,29,20,"Seest thou a man that is hasty in his words? there is more hope of a fool than of him."));
ensuperobject.biblemap.put("b20_29_21", new ensuperobject(20,29,21,"He that delicately bringeth up his servant from a child shall have him become his son at the length."));
ensuperobject.biblemap.put("b20_29_22", new ensuperobject(20,29,22,"An angry man stirreth up strife, and a furious man aboundeth in transgression."));
ensuperobject.biblemap.put("b20_29_23", new ensuperobject(20,29,23,"A man's pride shall bring him low: but honour shall uphold the humble in spirit."));
ensuperobject.biblemap.put("b20_29_24", new ensuperobject(20,29,24,"Whoso is partner with a thief hateth his own soul: he heareth cursing, and bewrayeth it not."));
ensuperobject.biblemap.put("b20_29_25", new ensuperobject(20,29,25,"The fear of man bringeth a snare: but whoso putteth his trust in the LORD shall be safe."));
ensuperobject.biblemap.put("b20_29_26", new ensuperobject(20,29,26,"Many seek the ruler's favour; but every man's judgment cometh from the LORD."));
ensuperobject.biblemap.put("b20_29_27", new ensuperobject(20,29,27,"An unjust man is an abomination to the just: and he that is upright in the way is abomination to the wicked."));
ensuperobject.biblemap.put("b20_30_1", new ensuperobject(20,30,1,"The words of Agur the son of Jakeh, even the prophecy: the man spake unto Ithiel, even unto Ithiel and Ucal,"));
ensuperobject.biblemap.put("b20_30_2", new ensuperobject(20,30,2,"Surely I am more brutish than any man, and have not the understanding of a man."));
ensuperobject.biblemap.put("b20_30_3", new ensuperobject(20,30,3,"I neither learned wisdom, nor have the knowledge of the holy."));
ensuperobject.biblemap.put("b20_30_4", new ensuperobject(20,30,4,"Who hath ascended up into heaven, or descended? who hath gathered the wind in his fists? who hath bound the waters in a garment? who hath established all the ends of the earth? what is his name, and what is his son's name, if thou canst tell?"));
ensuperobject.biblemap.put("b20_30_5", new ensuperobject(20,30,5,"Every word of God is pure: he is a shield unto them that put their trust in him."));
ensuperobject.biblemap.put("b20_30_6", new ensuperobject(20,30,6,"Add thou not unto his words, lest he reprove thee, and thou be found a liar."));
ensuperobject.biblemap.put("b20_30_7", new ensuperobject(20,30,7,"Two things have I required of thee; deny me them not before I die:"));
ensuperobject.biblemap.put("b20_30_8", new ensuperobject(20,30,8,"Remove far from me vanity and lies: give me neither poverty nor riches; feed me with food convenient for me:"));
ensuperobject.biblemap.put("b20_30_9", new ensuperobject(20,30,9,"Lest I be full, and deny thee, and say, Who is the LORD? or lest I be poor, and steal, and take the name of my God in vain."));
ensuperobject.biblemap.put("b20_30_10", new ensuperobject(20,30,10,"Accuse not a servant unto his master, lest he curse thee, and thou be found guilty."));
ensuperobject.biblemap.put("b20_30_11", new ensuperobject(20,30,11,"There is a generation that curseth their father, and doth not bless their mother."));
ensuperobject.biblemap.put("b20_30_12", new ensuperobject(20,30,12,"There is a generation that are pure in their own eyes, and yet is not washed from their filthiness."));
ensuperobject.biblemap.put("b20_30_13", new ensuperobject(20,30,13,"There is a generation, O how lofty are their eyes! and their eyelids are lifted up."));
ensuperobject.biblemap.put("b20_30_14", new ensuperobject(20,30,14,"There is a generation, whose teeth are as swords, and their jaw teeth as knives, to devour the poor from off the earth, and the needy from among men."));
ensuperobject.biblemap.put("b20_30_15", new ensuperobject(20,30,15,"The horseleach hath two daughters, crying, Give, give. There are three things that are never satisfied, yea, four things say not, It is enough:"));
ensuperobject.biblemap.put("b20_30_16", new ensuperobject(20,30,16,"The grave; and the barren womb; the earth that is not filled with water; and the fire that saith not, It is enough."));
ensuperobject.biblemap.put("b20_30_17", new ensuperobject(20,30,17,"The eye that mocketh at his father, and despiseth to obey his mother, the ravens of the valley shall pick it out, and the young eagles shall eat it."));
ensuperobject.biblemap.put("b20_30_18", new ensuperobject(20,30,18,"There be three things which are too wonderful for me, yea, four which I know not:"));
ensuperobject.biblemap.put("b20_30_19", new ensuperobject(20,30,19,"The way of an eagle in the air; the way of a serpent upon a rock; the way of a ship in the midst of the sea; and the way of a man with a maid."));
ensuperobject.biblemap.put("b20_30_20", new ensuperobject(20,30,20,"Such is the way of an adulterous woman; she eateth, and wipeth her mouth, and saith, I have done no wickedness."));
ensuperobject.biblemap.put("b20_30_21", new ensuperobject(20,30,21,"For three things the earth is disquieted, and for four which it cannot bear:"));
ensuperobject.biblemap.put("b20_30_22", new ensuperobject(20,30,22,"For a servant when he reigneth; and a fool when he is filled with meat;"));
ensuperobject.biblemap.put("b20_30_23", new ensuperobject(20,30,23,"For an odious woman when she is married; and an handmaid that is heir to her mistress."));
ensuperobject.biblemap.put("b20_30_24", new ensuperobject(20,30,24,"There be four things which are little upon the earth, but they are exceeding wise:"));
ensuperobject.biblemap.put("b20_30_25", new ensuperobject(20,30,25,"The ants are a people not strong, yet they prepare their meat in the summer;"));
ensuperobject.biblemap.put("b20_30_26", new ensuperobject(20,30,26,"The conies are but a feeble folk, yet make they their houses in the rocks;"));
ensuperobject.biblemap.put("b20_30_27", new ensuperobject(20,30,27,"The locusts have no king, yet go they forth all of them by bands;"));
ensuperobject.biblemap.put("b20_30_28", new ensuperobject(20,30,28,"The spider taketh hold with her hands, and is in kings' palaces."));
ensuperobject.biblemap.put("b20_30_29", new ensuperobject(20,30,29,"There be three things which go well, yea, four are comely in going:"));
ensuperobject.biblemap.put("b20_30_30", new ensuperobject(20,30,30,"A lion which is strongest among beasts, and turneth not away for any;"));
ensuperobject.biblemap.put("b20_30_31", new ensuperobject(20,30,31,"A greyhound; an he goat also; and a king, against whom there is no rising up."));
ensuperobject.biblemap.put("b20_30_32", new ensuperobject(20,30,32,"If thou hast done foolishly in lifting up thyself, or if thou hast thought evil, lay thine hand upon thy mouth."));
ensuperobject.biblemap.put("b20_30_33", new ensuperobject(20,30,33,"Surely the churning of milk bringeth forth butter, and the wringing of the nose bringeth forth blood: so the forcing of wrath bringeth forth strife."));
ensuperobject.biblemap.put("b20_31_1", new ensuperobject(20,31,1,"The words of king Lemuel, the prophecy that his mother taught him."));
ensuperobject.biblemap.put("b20_31_2", new ensuperobject(20,31,2,"What, my son? and what, the son of my womb? and what, the son of my vows?"));
ensuperobject.biblemap.put("b20_31_3", new ensuperobject(20,31,3,"Give not thy strength unto women, nor thy ways to that which destroyeth kings."));
ensuperobject.biblemap.put("b20_31_4", new ensuperobject(20,31,4,"It is not for kings, O Lemuel, it is not for kings to drink wine; nor for princes strong drink:"));
ensuperobject.biblemap.put("b20_31_5", new ensuperobject(20,31,5,"Lest they drink, and forget the law, and pervert the judgment of any of the afflicted."));
ensuperobject.biblemap.put("b20_31_6", new ensuperobject(20,31,6,"Give strong drink unto him that is ready to perish, and wine unto those that be of heavy hearts."));
ensuperobject.biblemap.put("b20_31_7", new ensuperobject(20,31,7,"Let him drink, and forget his poverty, and remember his misery no more."));
ensuperobject.biblemap.put("b20_31_8", new ensuperobject(20,31,8,"Open thy mouth for the dumb in the cause of all such as are appointed to destruction."));
ensuperobject.biblemap.put("b20_31_9", new ensuperobject(20,31,9,"Open thy mouth, judge righteously, and plead the cause of the poor and needy."));
ensuperobject.biblemap.put("b20_31_10", new ensuperobject(20,31,10,"Who can find a virtuous woman? for her price is far above rubies."));
ensuperobject.biblemap.put("b20_31_11", new ensuperobject(20,31,11,"The heart of her husband doth safely trust in her, so that he shall have no need of spoil."));
ensuperobject.biblemap.put("b20_31_12", new ensuperobject(20,31,12,"She will do him good and not evil all the days of her life."));
ensuperobject.biblemap.put("b20_31_13", new ensuperobject(20,31,13,"She seeketh wool, and flax, and worketh willingly with her hands."));
ensuperobject.biblemap.put("b20_31_14", new ensuperobject(20,31,14,"She is like the merchants' ships; she bringeth her food from afar."));
ensuperobject.biblemap.put("b20_31_15", new ensuperobject(20,31,15,"She riseth also while it is yet night, and giveth meat to her household, and a portion to her maidens."));
ensuperobject.biblemap.put("b20_31_16", new ensuperobject(20,31,16,"She considereth a field, and buyeth it: with the fruit of her hands she planteth a vineyard."));
ensuperobject.biblemap.put("b20_31_17", new ensuperobject(20,31,17,"She girdeth her loins with strength, and strengtheneth her arms."));
ensuperobject.biblemap.put("b20_31_18", new ensuperobject(20,31,18,"She perceiveth that her merchandise is good: her candle goeth not out by night."));
ensuperobject.biblemap.put("b20_31_19", new ensuperobject(20,31,19,"She layeth her hands to the spindle, and her hands hold the distaff."));
ensuperobject.biblemap.put("b20_31_20", new ensuperobject(20,31,20,"She stretcheth out her hand to the poor; yea, she reacheth forth her hands to the needy."));
ensuperobject.biblemap.put("b20_31_21", new ensuperobject(20,31,21,"She is not afraid of the snow for her household: for all her household are clothed with scarlet."));
ensuperobject.biblemap.put("b20_31_22", new ensuperobject(20,31,22,"She maketh herself coverings of tapestry; her clothing is silk and purple."));
ensuperobject.biblemap.put("b20_31_23", new ensuperobject(20,31,23,"Her husband is known in the gates, when he sitteth among the elders of the land."));
ensuperobject.biblemap.put("b20_31_24", new ensuperobject(20,31,24,"She maketh fine linen, and selleth it; and delivereth girdles unto the merchant."));
ensuperobject.biblemap.put("b20_31_25", new ensuperobject(20,31,25,"Strength and honour are her clothing; and she shall rejoice in time to come."));
ensuperobject.biblemap.put("b20_31_26", new ensuperobject(20,31,26,"She openeth her mouth with wisdom; and in her tongue is the law of kindness."));
ensuperobject.biblemap.put("b20_31_27", new ensuperobject(20,31,27,"She looketh well to the ways of her household, and eateth not the bread of idleness."));
ensuperobject.biblemap.put("b20_31_28", new ensuperobject(20,31,28,"Her children arise up, and call her blessed; her husband also, and he praiseth her."));
ensuperobject.biblemap.put("b20_31_29", new ensuperobject(20,31,29,"Many daughters have done virtuously, but thou excellest them all."));
ensuperobject.biblemap.put("b20_31_30", new ensuperobject(20,31,30,"Favour is deceitful, and beauty is vain: but a woman that feareth the LORD, she shall be praised."));
ensuperobject.biblemap.put("b20_31_31", new ensuperobject(20,31,31,"Give her of the fruit of her hands; and let her own works praise her in the gates."));

}

}